(35, 'COBRE PREMIUM', 'La Categoría de productos Premium, engloba los artículos de cobre o cobrizados. Estos se trabajan con su respectiva personalización o grabado, para hacer su obsequio un producto exclusivo.', 1, '5ecd342fb4a7f-icono-cobre.png', '2020-04-28 12:38:20', '2020-09-16 11:01:11', 46),
