(41, 'SEÑALETICA', 'Contamos con Señaletica impresa en plotter Ecosolventado,\r\nAplicando normas reglamentaras en el Manual del Tránsito como normas de Minería', 1, '5ecd348fe6646-icono-señaletica.png', '2020-04-28 12:40:05', '2020-08-21 17:40:14', 47),
