INSERT INTO `popups` (`id`, `name`, `content`, `image`, `default`, `active`, `created_at`, `updated_at`) VALUES
(9, 'chrome', 'Nuestra plataforma de compra esta optimizado para el navegador Google Chrome.\r\nTe recomendamos usarlo para que tengas la mejor experiencia.', '614c77447883d-BANNER POP UP CHROME.jpg', 0, 0, '2023-12-29 15:55:51', '2023-12-29 13:55:51'),
(10, 'UN SIMPLE GESTO!', 'Por que sabemos el esfuerzo que pones en cada ocasión, te motivamos a reconocer a tus trabajadores y/o seres queridos con una muestra de aprecio.\r\nuna pequeña acción puede tener consigo un montón de emociones.\r\nUN SIMPLE DETALLE hace la diferencia.', '5ecfce9048329-BANNER-POP-UP-SIMPLE-DETALLE.jpg', 0, 0, '2023-12-29 15:55:51', '2023-12-29 13:55:51'),
(11, 'PRODUCTOS COVID', 'CONTAMOS CON PRODUCTOS PARA PROTEGERTE A TI Y A SU FAMILIA \r\n-OVEROLES DESECHABLES \r\n-GUANTES DESECHABLES DE VINILO, LATEX Y NITRILO \r\n-VISORES FACIALES SHIELD\r\n-LENTES DE SEGURIDAD BIFOCALES\r\n-MASCARILLAS DESECHABLES Y KN95\r\n\r\nNUESTRA TIENDA FÍSICA EN SANTIAGO SE ENCUENTRA OPERATIVA, Y DESPACHANDO A NUESTROS CLIENTES  DE TODO CHILE INCLUIDA LAS ZONAS DE CUARENTENA.', '5f36d65c4ac20-banner covid-01.jpg', 0, 0, '2023-12-29 15:55:51', '2023-12-29 13:55:51'),
(12, 'Navidad', 'En esta Navidad sorprende a las personas que mas quieres con estos preciosos regalos!\r\ncontamos con una amplia gama de productos de Cobre Nacional, todo con un lujoso estuche, perfecto para regalos.\r\nDate una vuelta por nuestro categoría de Cobre! Encontrarás productos tales como:\r\n-Mates de Cobre\r\n-Set de tazas de café\r\n-Set de Copas \r\n-Artículos Decohogar y mucho más!', '5fb519538acc0-banner-pop-up-navidad.jpg', 0, 0, '2023-12-29 15:55:51', '2023-12-29 13:55:51'),
(13, 'Colección whisky', 'Disfruta de la nueva colección que tenemos para todos los amantes del buen whisky!\r\nSet de vasos de whisky + Jack Daniels', '640a157cbe933-BANNER-POP-UP-WHISKY.jpg', 0, 0, '2023-12-29 15:55:51', '2023-12-29 13:55:51'),
(14, 'Retiro en Oficina', 'Puedes Retirar tu Producto en Nuestras Oficina 1 día hábil después de tu compra\r\nEstamos en Hamburgo 265, Ñuñoa\r\n-Lunes a jueves: 10:00 a 18:00hrs.\r\n-Viernes: 10:00 a 13:00hrs', '658eec07a4c91-Banner-Retiro-en-Tienda.jpg', 1, 1, '2023-12-29 15:55:51', '2023-12-29 13:55:51');
