(220, 'Set de 4 piezas de Cobre para Escritorio', '1000 01 014', NULL, 176900.00, 1, '2020-05-07 19:22:50', '2023-11-26 17:46:24', 111, 2060, '<p><em><strong>El Set de 4 Piezas de Cobre para Escritorio de 100% Cobre Chileno de la marca Perfect Class es una colecci&oacute;n exclusiva que fusiona la funcionalidad con la elegancia distintiva del cobre. Cada pieza ha sido meticulosamente confeccionada con cobre chileno de la m&aacute;s alta calidad, ofreciendo un conjunto sofisticado para elevar la est&eacute;tica de tu escritorio.</strong></em></p>\r\n\r\n<p><em><strong>Caracter&iacute;sticas Principales:</strong></em></p>\r\n\r\n<ol>\r\n	<li><em><strong>Dise&ntilde;o Coordinado y Elegante:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>El set incluye cuatro piezas coordinadas que se complementan entre s&iacute; para ofrecer una est&eacute;tica armoniosa en tu escritorio. Cada detalle, desde la forma hasta el acabado, ha sido cuidadosamente dise&ntilde;ado para destacar la belleza del cobre chileno.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>100% Cobre Chileno de Alta Pureza:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>Fabricado con cobre chileno de pureza inigualable, cada pieza del set destaca por su autenticidad y durabilidad excepcionales. La elecci&oacute;n del cobre chileno agrega nobleza al dise&ntilde;o, asegurando la calidad &uacute;nica de cada elemento.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>Acabado Pulido y Brillante:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>El acabado pulido del cobre agrega un brillo excepcional a cada pieza del set, creando una presentaci&oacute;n deslumbrante. La superficie pulida refleja la luz de manera cautivadora, resaltando la elegancia de cada detalle.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>Versatilidad y Funcionalidad:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>Cada pieza del set no solo es decorativa, sino tambi&eacute;n funcional, proporcionando soluciones organizativas con un toque de lujo. El conjunto se adapta a diversas necesidades en tu espacio de trabajo.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p><em><strong>Cuidado del Producto: Se recomienda limpiar con un pa&ntilde;o suave y h&uacute;medo para mantener el brillo y la elegancia del cobre. Evitar el uso de productos abrasivos que puedan afectar el acabado.</strong></em></p>', '', 1, 1, 176900.00, NULL, 0, NULL, NULL, NULL, NULL),
(221, 'Porta Tarjeta modelo Sobre', '1000 01 003', NULL, 34900.00, 1, '2020-05-07 19:23:49', '2023-11-26 17:36:24', 111, 2058, '<p><em><strong>El Tarjetero de Escritorio con Forma de Sobre de 100% Cobre Chileno de la marca Perfect Class es una pieza &uacute;nica que combina la funcionalidad de organizar tarjetas con la elegancia del dise&ntilde;o en cobre. Cada tarjetero ha sido cuidadosamente confeccionado con cobre chileno de la m&aacute;s alta calidad, ofreciendo una forma distinguida de presentar y organizar tus tarjetas.</strong></em></p>\r\n\r\n<p><em><strong>Caracter&iacute;sticas Principales:</strong></em></p>\r\n\r\n<ol>\r\n	<li><em><strong>Dise&ntilde;o de Sobre Elegante:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>El tarjetero adopta la forma de un sobre, aportando un toque de elegancia y sofisticaci&oacute;n a tu escritorio. El dise&ntilde;o cuidado y estilizado refleja la belleza del cobre chileno, creando una pieza que combina funcionalidad con arte.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>100% Cobre Chileno de Alta Pureza:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>Fabricado con cobre chileno de pureza inigualable, este tarjetero destaca por su autenticidad y durabilidad excepcionales. La elecci&oacute;n del cobre chileno no solo ofrece nobleza al dise&ntilde;o, sino que tambi&eacute;n asegura la calidad &uacute;nica de cada pieza.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>Capacidad para Tarjetas de Visita:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>El tarjetero ha sido dise&ntilde;ado para contener tarjetas de visita de manera ordenada y accesible. Su forma y tama&ntilde;o garantizan que puedas organizar y presentar tus tarjetas de manera elegante en cualquier entorno profesional.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>Acabado Pulido y Brillante:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>El acabado pulido del cobre agrega un brillo excepcional al tarjetero, creando una presentaci&oacute;n deslumbrante. La superficie pulida refleja la luz de manera cautivadora, resaltando la elegancia de cada detalle.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>Pieza Decorativa Funcional:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>Adem&aacute;s de su funci&oacute;n pr&aacute;ctica, este tarjetero se convierte en una pieza decorativa que a&ntilde;ade estilo a tu escritorio. Su dise&ntilde;o &uacute;nico y distintivo lo convierte en un elemento de conversaci&oacute;n y en una expresi&oacute;n de buen gusto.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p><em><strong>Cuidado del Producto: Se recomienda limpiar con un pa&ntilde;o suave y h&uacute;medo para mantener el brillo y la elegancia del cobre. Evitar el uso de productos abrasivos que puedan afectar el acabado.</strong></em></p>', '605a2553b7c16-FICHA-TECNICA-sobre-escritorio.jpg', 1, 4, 34900.00, NULL, 0, NULL, NULL, NULL, NULL),
(222, 'Mate de Cobre c/Bombilla', '100 01 022', NULL, 56900.00, 1, '2020-05-07 19:27:09', '2024-03-28 09:55:12', 111, 2048, '<p><em><strong>El Mate con Bombilla de Cobre Chileno de la marca Perfect Class redefine la experiencia del mate, fusionando la tradici&oacute;n con un dise&ntilde;o elegante y distintivo. Cada mate ha sido cuidadosamente confeccionado en cobre chileno de alta calidad, ofreciendo no solo una herramienta para disfrutar de la infusi&oacute;n, sino tambi&eacute;n una obra de arte que refleja la riqueza de la cultura del mate.</strong></em></p>\r\n\r\n<p><em><strong>Caracter&iacute;sticas Principales:</strong></em></p>\r\n\r\n<ol>\r\n	<li><em><strong>Dise&ntilde;o Elegante y Funcional:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>El dise&ntilde;o del mate combina la elegancia con la funcionalidad, proporcionando una experiencia de mate &uacute;nica. La forma estilizada y los detalles cuidadosamente trabajados a&ntilde;aden un toque distintivo a cada encuentro con esta tradicional infusi&oacute;n.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>Cobre Chileno de Alta Calidad:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>Fabricado con cobre chileno de primera calidad, este mate destaca por su belleza y durabilidad excepcionales. La elecci&oacute;n del material no solo agrega un toque de lujo, sino que tambi&eacute;n preserva la autenticidad de la preparaci&oacute;n del mate.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>Acabado Pulido y Brillante:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>El acabado pulido del cobre agrega un brillo excepcional al mate, creando una presentaci&oacute;n deslumbrante para esta tradicional bebida. La superficie pulida refleja la luz de manera cautivadora, realzando la experiencia de compartir el mate.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>Bombilla Dise&ntilde;ada para un Sorbo Perfecto:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>La bombilla ha sido cuidadosamente dise&ntilde;ada para garantizar un sorbo c&oacute;modo y pleno. La funcionalidad se une a la elegancia, haciendo que cada mate sea una experiencia placentera.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>Versatilidad en el Uso:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>Ideal para disfrutar del mate tradicional o con hierbas arom&aacute;ticas. Este mate es vers&aacute;til y se adapta a diferentes preferencias, manteniendo siempre la elegancia en cada preparaci&oacute;n.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p><em><strong>Cuidado del Producto: Se recomienda limpiar con un cepillo especial para bombilla y un pa&ntilde;o suave y h&uacute;medo para mantener el brillo y la elegancia del cobre. Evitar el uso de productos abrasivos que puedan afectar el acabado.</strong></em></p>\r\n\r\n<p>&nbsp;</p>', '', 1, 5, 56900.00, NULL, 0, NULL, NULL, NULL, NULL),
(223, 'Joyero de Cobre C/ Estuche', '1000 01 046', NULL, 41900.00, 1, '2020-05-07 19:28:01', '2023-11-26 17:27:56', 111, 2055, '<p><em><strong>El Joyero Circular de 100% Cobre Chileno de la marca Perfect Class es una obra de arte funcional que fusiona la belleza del dise&ntilde;o con la nobleza del cobre chileno. Cada joyero ha sido cuidadosamente confeccionado con cobre chileno de la m&aacute;s alta calidad, ofreciendo un espacio elegante para resguardar tus joyas con estilo.</strong></em></p>\r\n\r\n<p><em><strong>Caracter&iacute;sticas Principales:</strong></em></p>\r\n\r\n<ol>\r\n	<li><em><strong>Dise&ntilde;o Circular Elegante:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>El joyero presenta un dise&ntilde;o circular que aporta elegancia y sofisticaci&oacute;n a cualquier espacio. La forma &uacute;nica destaca la belleza del cobre chileno, creando una pieza distintiva y atemporal.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>100% Cobre Chileno de Alta Pureza:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>Fabricado con cobre chileno de pureza inigualable, este joyero destaca por su autenticidad y durabilidad excepcionales. La elecci&oacute;n del cobre chileno garantiza la nobleza del material y la calidad &uacute;nica de cada pieza.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>Tapa Decorativa y Funcional:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>La tapa del joyero no solo es un elemento decorativo, sino que tambi&eacute;n cumple una funci&oacute;n pr&aacute;ctica al proteger tus joyas. El dise&ntilde;o cuidado de la tapa agrega un toque distintivo a la presentaci&oacute;n general del joyero.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>Acabado Pulido y Brillante:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>El acabado pulido del cobre agrega un brillo excepcional al joyero, creando una presentaci&oacute;n deslumbrante. La superficie pulida refleja la luz de manera cautivadora, resaltando la elegancia de cada detalle.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p><em><strong>Cuidado del Producto: Se recomienda limpiar con un pa&ntilde;o suave y h&uacute;medo para mantener el brillo y la elegancia del cobre. Evitar el uso de productos abrasivos que puedan afectar el acabado.</strong></em></p>', '', 1, 5, 41900.00, NULL, 0, NULL, NULL, NULL, NULL),
