(231, 'Set de 2 Tazas de Café Oslo C/ Cucharillas y platillos de Cobre', '1000 01 012-2', NULL, 50700.00, 0, '2020-05-07 19:40:57', '2021-12-13 20:06:07', 103, 1058, '<h3><ins><em><strong>Descripci&oacute;n </strong></em></ins></h3>\r\n\r\n<p>Disfruta de tu Caf&eacute; en estas pr&aacute;cticas tazas de vidrios, ideales para compartir en momentos especiales. Adornas cualquier tipo de mesa y transmiten la noci&oacute;n de elegancia y lujo.</p>\r\n\r\n<ul>\r\n	<li>El set incluye:</li>\r\n	<li>2 finas tacitas de caf&eacute; de cristal con detalles confeccionadas en cobre</li>\r\n	<li>Cucharillas y platillos hechos en cobre</li>\r\n	<li>Estuche de Lujo</li>\r\n</ul>\r\n\r\n<h3><em><strong>Especificaciones:</strong></em></h3>\r\n\r\n<ul>\r\n	<li>Marca: Qdigital</li>\r\n	<li>Peso (kg): 1</li>\r\n	<li>Tipo de Producto: Set de Tazas de C&aacute;fe</li>\r\n	<li>Alto (cm): 6</li>\r\n	<li>Ancho (cm): 7</li>\r\n	<li>Di&aacute;metro (cm): 7</li>\r\n	<li>Garant&iacute;a: 2 Meses</li>\r\n	<li>Material: Vidrio / Cobre</li>\r\n	<li>Medidas del Estuche (cms): 12 x 17 x 28</li>\r\n	<li>Modelo: 1000 01 012-2</li>\r\n	<li>Numero de piezas: 6</li>\r\n</ul>\r\n\r\n<p><em><strong>Cuidados del Producto</strong></em></p>\r\n\r\n<ul>\r\n	<li>Solo Limpiar o lavar sin productos abrasivos</li>\r\n	<li>Usar pa&ntilde;os suaves</li>\r\n</ul>', '60e73ebc75cf5-FICHA-TECNICA-2-tazas-de-cafe-oslo.jpg', 0, 5, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(232, 'Posa Vaso de 7 piezas de Cobre', '1000 01 013', NULL, 113900.00, 1, '2020-05-07 19:42:05', '2023-11-23 19:32:42', 111, 2019, '<p><em><strong>El Set de 7 Posa Vasos de Cobre Chileno de la marca Perfect Class es la manifestaci&oacute;n suprema de elegancia y artesan&iacute;a refinada. Cada posa vaso en este exclusivo conjunto ha sido meticulosamente confeccionado en cobre chileno de la m&aacute;s alta calidad, creando una experiencia &uacute;nica de estilo y distinci&oacute;n.</strong></em></p>\r\n\r\n<p><em><strong>Caracter&iacute;sticas Principales:</strong></em></p>\r\n\r\n<ol>\r\n	<li><em><strong>Dise&ntilde;o Exquisito:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>Cada posa vaso presenta un dise&ntilde;o exquisito que fusiona la tradici&oacute;n del cobre chileno con un toque de modernidad. La forma delicadamente trabajada a&ntilde;ade un elemento de lujo a cualquier mesa.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>Cobre Chileno de Alta Calidad:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>Fabricados con cobre chileno de primera calidad, estos posa vasos destacan por su belleza atemporal y durabilidad excepcional. La elecci&oacute;n del material asegura una base s&oacute;lida y lujosa para tus vasos.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>Acabado Pulido y Resplandeciente:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>El acabado pulido del cobre proporciona un brillo resplandeciente que realza la presentaci&oacute;n de tus vasos. Cada posa vaso refleja la luz de manera sutil, creando un ambiente de sofisticaci&oacute;n.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>Set Completo para Tus Necesidades:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>Este conjunto de 7 posa vasos es perfecto para diversas ocasiones. Ya sea para una reuni&oacute;n &iacute;ntima o una celebraci&oacute;n especial, el set completo se adapta a todas tus necesidades de presentaci&oacute;n.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>Versatilidad en Estilos de Bebidas:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>Dise&ntilde;ados para acomodar una variedad de vasos y bebidas, desde c&oacute;cteles hasta copas de whisky. La versatilidad de este set garantiza su utilidad en cualquier configuraci&oacute;n.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p><em><strong>Cuidado del Producto: Se recomienda limpiar con un pa&ntilde;o suave y h&uacute;medo para mantener el brillo y la elegancia del cobre. Evitar el uso de productos abrasivos que puedan afectar el acabado.</strong></em></p>', '', 1, 10, 113900.00, NULL, 0, NULL, NULL, NULL, NULL),
