(236, 'Casco de Cobre para Escritorio', '1000 01 020', NULL, 76000.00, 1, '2020-05-07 19:47:03', '2023-11-26 16:45:53', 111, 2050, '<p><em><strong>El Casco de Minero para Escritorio de 100% Cobre Chileno de la marca Perfect Class es una fusi&oacute;n de autenticidad y elegancia, dise&ntilde;ado para agregar un toque &uacute;nico y distinguido a tu espacio de trabajo. Cada casco ha sido cuidadosamente confeccionado con cobre chileno de la m&aacute;s alta calidad, representando una obra de arte funcional que rinde homenaje a la tradici&oacute;n minera con estilo.</strong></em></p>\r\n\r\n<p><em><strong>Caracter&iacute;sticas Principales:</strong></em></p>\r\n\r\n<ol>\r\n	<li><em><strong>Dise&ntilde;o Elegante y Funcional para Escritorio:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>El casco de minero ha sido miniaturizado con un dise&ntilde;o elegante, perfecto para decorar tu escritorio con un toque de autenticidad y distinci&oacute;n. </strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>100% Cobre Chileno:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>Fabricado con cobre chileno de pureza inigualable, este casco destaca por su autenticidad y nobleza. La elecci&oacute;n del cobre chileno no solo rinde homenaje a la rica historia minera, sino que tambi&eacute;n garantiza la durabilidad y calidad excepcional del producto.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>Acabado Pulido y Brillante:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>El acabado pulido del cobre agrega un brillo excepcional al casco, creando una presentaci&oacute;n deslumbrante en tu escritorio. La superficie pulida refleja la luz de manera cautivadora, realzando cada detalle de esta pieza &uacute;nica.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>Tama&ntilde;o Compacto para Espacios de Trabajo:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>Con dimensiones compactas, este casco se adapta perfectamente a cualquier escritorio, a&ntilde;adiendo un toque de elegancia y singularidad a tu espacio de trabajo.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>Elemento de Conversaci&oacute;n:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>Este casco no solo es una pieza decorativa, sino tambi&eacute;n un elemento de conversaci&oacute;n. Su dise&ntilde;o aut&eacute;ntico y elegante seguro llamar&aacute; la atenci&oacute;n y generar&aacute; inter&eacute;s en la historia y tradici&oacute;n minera.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p><em><strong>Cuidado del Producto: Se recomienda limpiar con un pa&ntilde;o suave y h&uacute;medo para mantener el brillo y la elegancia del cobre. Evitar el uso de productos abrasivos que puedan afectar el acabado.</strong></em></p>', '60e73f6a9c3bb-FICHA-TECNICA-casco-minero.jpg', 1, 1, 76000.00, NULL, 0, NULL, NULL, NULL, NULL),
