(314, 'Casco 100% Cobre de Tamaño Real', '1000 01 039', NULL, 198900.00, 1, '2020-05-27 14:58:12', '2023-11-26 16:42:13', 111, 2049, '<p><em><strong>El Casco de Minero Tama&ntilde;o Real de 100% Cobre Chileno de la marca Perfect Class es una obra maestra que fusiona la autenticidad con la elegancia. Cada casco ha sido meticulosamente confeccionado con cobre chileno de la m&aacute;s alta calidad, representando una pieza &uacute;nica que rinde homenaje a la tradici&oacute;n minera con un toque de lujo.</strong></em></p>\r\n\r\n<p><em><strong>Caracter&iacute;sticas Principales:</strong></em></p>\r\n\r\n<ol>\r\n	<li><em><strong>Dise&ntilde;o Realista y Detallado:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>El casco de minero a tama&ntilde;o real presenta un dise&ntilde;o realista y detallado que refleja la autenticidad de la tradici&oacute;n minera. Cada detalle de la estructura del casco, se ha recreado con maestr&iacute;a.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>100% Cobre Chileno:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>Fabricado con cobre chileno de pureza inigualable, este casco destaca por su autenticidad y nobleza. La elecci&oacute;n del cobre chileno no solo rinde homenaje a la rica historia minera, sino que tambi&eacute;n garantiza la durabilidad y calidad excepcional del producto.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>Acabado Pulido y Brillante:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>El acabado pulido del cobre agrega un brillo excepcional al casco, creando una presentaci&oacute;n deslumbrante. La superficie pulida refleja la luz de manera cautivadora, realzando cada detalle y rinc&oacute;n de este homenaje a la tradici&oacute;n minera.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>Tama&ntilde;o Real para un Impacto Visual:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>Con dimensiones fieles a un casco de minero real, esta pieza se convierte en un elemento impactante en cualquier espacio. Su tama&ntilde;o realista garantiza una representaci&oacute;n aut&eacute;ntica y memorable.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>Base S&oacute;lida para Exhibici&oacute;n:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>El casco se presenta sobre una base s&oacute;lida, asegurando una exhibici&oacute;n estable y segura. Perfecto para destacar en estanter&iacute;as, vitrinas o cualquier lugar donde se desee rendir tributo a la historia minera con estilo.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p><em><strong>Cuidado del Producto: Se recomienda limpiar con un pa&ntilde;o suave y h&uacute;medo para mantener el brillo y la elegancia del cobre. Evitar el uso de productos abrasivos que puedan afectar el acabado.</strong></em></p>', '', 1, 1, 198900.00, NULL, 0, NULL, NULL, NULL, NULL);
