(390, 'Set de 2 Tazas Café Castillo', '1000 01 068', NULL, 110900.00, 1, '2020-09-16 10:31:27', '2023-11-27 23:21:54', 111, 2020, '<p><em><strong>El Set de Tazas Caf&eacute; Castillo con Cucharillas y Platos de Cobre Chileno de la marca Perfect Class es la culminaci&oacute;n de elegancia, funcionalidad y artesan&iacute;a refinada. Este conjunto redefine la experiencia de disfrutar de un caf&eacute;, ofreciendo un dise&ntilde;o exclusivo y una calidad excepcional que solo el cobre chileno puede brindar.</strong></em></p>\r\n\r\n<p><em><strong>Contenido del Set:</strong></em></p>\r\n\r\n<ol>\r\n	<li><em><strong>2 Tazas Caf&eacute; Castillo de Cobre Chileno:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>Dise&ntilde;o inspirado en la elegancia cl&aacute;sica con un toque contempor&aacute;neo.</strong></em></li>\r\n		<li><em><strong>Confeccionadas con cobre chileno de primera calidad.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>2 Cucharillas a Juego:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>Complementan las tazas con un dise&ntilde;o coordinado y detalles refinados.</strong></em></li>\r\n		<li><em><strong>Fabricadas con la misma artesan&iacute;a excepcional en cobre chileno.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>2 Platos Coordinados:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>Platos dise&ntilde;ados para resaltar la presentaci&oacute;n de las tazas.</strong></em></li>\r\n		<li><em><strong>Confeccionados en cobre chileno para una armon&iacute;a perfecta en el conjunto.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p><em><strong>Caracter&iacute;sticas Principales:</strong></em></p>\r\n\r\n<ol>\r\n	<li><em><strong>Dise&ntilde;o &Uacute;nico y Distintivo:</strong></em></li>\r\n</ol>\r\n\r\n<u