(393, 'Tarjetero de Escritorio Cobre', '1000 01 001', NULL, 90900.00, 1, '2020-09-17 14:16:46', '2023-11-26 17:43:15', 111, 2059, '<p><em><strong>La Caja para Tarjetas de Escritorio de 100% Cobre Chileno de la marca Perfect Class es una obra maestra que fusiona la funcionalidad con la elegancia distintiva del cobre. Cada caja ha sido meticulosamente confeccionada con cobre chileno de la m&aacute;s alta calidad, ofreciendo un espacio sofisticado para organizar y presentar tus tarjetas con estilo.</strong></em></p>\r\n\r\n<p><em><strong>Caracter&iacute;sticas Principales:</strong></em></p>\r\n\r\n<ol>\r\n	<li><em><strong>Dise&ntilde;o Exclusivo y Elegante:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>La caja presenta un dise&ntilde;o exclusivo que combina la sofisticaci&oacute;n con la funcionalidad. La forma estilizada y los detalles cuidadosamente trabajados resaltan la belleza del cobre chileno, creando una pieza &uacute;nica para tu escritorio.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>100% Cobre Chileno de Alta Pureza:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>Fabricada con cobre chileno de pureza inigualable, esta caja destaca por su autenticidad y durabilidad excepcionales. La elecci&oacute;n del cobre chileno agrega nobleza al dise&ntilde;o, asegurando la calidad &uacute;nica de cada pieza.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>Capacidad para Tarjetas de Visita:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>La caja ha sido dise&ntilde;ada para contener tarjetas de visita de manera organizada y accesible. Su interior espacioso garantiza que puedas presentar y organizar tus tarjetas con elegancia en cualquier entorno profesional.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>Tapa Decorativa y Funcional:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>La tapa de la caja no solo es un elemento decorativo, sino que tambi&eacute;n cumple una funci&oacute;n pr&aacute;ctica al proteger tus tarjetas. El dise&ntilde;o detallado y la tapa ajustada a&ntilde;aden un toque distintivo a la presentaci&oacute;n general de la caja.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>Acabado Pulido y Brillante:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>El acabado pulido del cobre agrega un brillo excepcional a la caja, creando una presentaci&oacute;n deslumbrante. La superficie pulida refleja la luz de manera cautivadora, resaltando la elegancia de cada detalle.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p><em><strong>Cuidado del Producto: Se recomienda limpiar con un pa&ntilde;o suave y h&uacute;medo para mantener el brillo y la elegancia del cobre. Evitar el uso de productos abrasivos que puedan afectar el acabado</strong></em>.</p>', '', 1, 4, 90900.00, NULL, 0, NULL, NULL, NULL, NULL),
