(400, 'Set Premium Copas + VINO', '1000 01 008EE', NULL, 177900.00, 1, '2020-10-01 12:10:39', '2023-11-23 16:57:03', 111, 2007, '<p><em><strong>El Set Edici&oacute;n Limitada de Cobre Chileno de la marca Perfect Class es una expresi&oacute;n &uacute;nica de lujo y elegancia. Este exclusivo conjunto combina la sofisticaci&oacute;n del cobre chileno con elementos esenciales para disfrutar de una experiencia de degustaci&oacute;n de vinos inigualable.</strong></em></p>\r\n\r\n<p><em><strong>Contenido del Set:</strong></em></p>\r\n\r\n<ol>\r\n	<li><em><strong>2 Copas de Vino Altas de Cobre Chileno:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>Elaboradas con la m&aacute;s alta calidad de cobre chileno.</strong></em></li>\r\n		<li><em><strong>Dise&ntilde;o alto que realza la presentaci&oacute;n del vino y resalta su aroma y sabor.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>1 Botella de Vino Casillero del Diablo:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>Un vino de renombre que complementa la excelencia del set.</strong></em></li>\r\n		<li><em><strong>Seleccionado para elevar la experiencia de degustaci&oacute;n.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>2 Porta Vasos de Cobre Chileno:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>Dise&ntilde;ados para combinar con las copas y a&ntilde;adir un toque elegante a la presentaci&oacute;n.</strong></em></li>\r\n		<li><em><strong>Funcionales y est&eacute;ticos, protegen las superficies y realzan la experiencia.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>1 Corta Gotas de Cobre Chileno:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>Herramienta esencial para un servicio de vino impecable.</strong></em></li>\r\n		<li><em><strong>Confeccionado en cobre para una funcionalidad y elegancia excepcionales.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>1 Base para Botella de Cobre Chileno:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>Dise&ntilde;o &uacute;nico que sostiene la botella con gracia y estilo.</strong></em></li>\r\n		<li><em><strong>Un complemento perfecto para la presentaci&oacute;n de la botella de Casillero del Diablo.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p><em><strong>Caracter&iacute;sticas Principales:</strong></em></p>\r\n\r\n<ol>\r\n	<li><em><strong>Edici&oacute;n Limitada: Este set es una joya exclusiva, limitada en su producci&oacute;n, lo que lo convierte en un art&iacute;culo de colecci&oacute;n para los amantes del buen vino y la artesan&iacute;a refinada.</strong></em></li>\r\n	<li><em><strong>Artesan&iacute;a Excepcional: Cada pieza del set est&aacute; confeccionada por artesanos expertos que han perfeccionado el arte de trabajar el cobre chileno. La atenci&oacute;n al detalle se refleja en cada elemento, desde las copas hasta la base para botella.</strong></em></li>\r\n	<li><em><strong>Presentaci&oacute;n Impecable: El conjunto ha sido dise&ntilde;ado para ofrecer una presentaci&oacute;n impecable en cualquier ocasi&oacute;n. Ya sea para una cena &iacute;ntima o una celebraci&oacute;n especial, este set a&ntilde;ade un toque de lujo a cada evento.</strong></em></li>\r\n	<li><em><strong>Regalo Excepcional: Ideal como regalo de lujo para aquellos que aprecian la calidad, la elegancia y la experiencia de disfrutar de un buen vino.</strong></em></li>\r\n</ol>\r\n\r\n<p><em><strong>Cuidado del Producto: Se recomienda un cuidado delicado al lavar a mano para preservar la belleza y la integridad del cobre. Evitar el uso de detergentes abrasivos.</strong></em></p>\r\n\r\n<p>&nbsp;</p>', '', 1, 10, 177900.00, NULL, 0, NULL, NULL, NULL, NULL),
(401, 'Bandeja de Cobre 20x15 cms Ovalada', '1000 01 005', NULL, 65900.00, 1, '2020-10-01 12:39:05', '2023-11-24 20:51:25', 111, 2027, '<p><em><strong>Las Bandejas de Cobre Chileno de la marca Perfect Class son la definici&oacute;n misma de la elegancia funcional. Estas bandejas, confeccionadas con esmero en cobre chileno de alta calidad, no solo sirven como pr&aacute;cticos accesorios para el servicio, sino que tambi&eacute;n a&ntilde;aden un toque de lujo y distinci&oacute;n a cualquier entorno.</strong></em></p>\r\n\r\n<p><em><strong>Caracter&iacute;sticas Principales:</strong></em></p>\r\n\r\n<ol>\r\n	<li><em><strong>Dise&ntilde;o Elegante y Vers&aacute;til:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>Cada bandeja ha sido dise&ntilde;ada con un toque de sofisticaci&oacute;n que se adapta a una variedad de estilos y ocasiones. Desde la presentaci&oacute;n de aperitivos hasta el servicio de bebidas, estas bandejas se destacan por su versatilidad y elegancia atemporal.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>Artesan&iacute;a Excepcional en Cobre Chileno:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>El cobre chileno de alta calidad utilizado en la confecci&oacute;n de estas bandejas resalta la artesan&iacute;a excepcional. Cada detalle, desde los bordes finamente trabajados hasta la superficie pulida, refleja la dedicaci&oacute;n y la destreza de nuestros artesanos.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>Acabado Brillante y Duradero:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>El acabado pulido del cobre proporciona un brillo excepcional que perdura a lo largo del tiempo. Este acabado no solo es est&eacute;ticamente atractivo, sino que tambi&eacute;n facilita la limpieza y el mantenimiento de la bandeja.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>Usos M&uacute;ltiples y Decorativos:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>Ideal para servir bebidas, presentar aperitivos o incluso como un elemento decorativo en s&iacute; mismo. Estas bandejas se adaptan perfectamente a diversas situaciones, aportando un toque de distinci&oacute;n a cada ocasi&oacute;n.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p><em><strong>Cuidado del Producto: Se recomienda limpiar las bandejas con un pa&ntilde;o suave y h&uacute;medo para preservar su brillo y elegancia. Evitar el uso de productos abrasivos que puedan da&ntilde;ar el acabado del cobre.</strong></em></p>', '', 1, 10, 65900.00, NULL, 0, NULL, NULL, NULL, NULL),
