ratura:</em></strong></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><strong><em>El espesor cuidadosamente seleccionado del cobre contribuye a la conservaci&oacute;n &oacute;ptima de la temperatura del whisky. Mant&eacute;n tu bebida a la temperatura perfecta durante m&aacute;s tiempo, disfrutando de cada matiz de sabor.</em></strong></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><strong><em>Ergonom&iacute;a para una Experiencia C&oacute;moda:</em></strong></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><strong><em>La forma ergon&oacute;mica de los vasos permite un agarre c&oacute;modo y seguro. Disfruta de tu whisky favorito con estilo y comodidad, resaltando cada detalle de la degustaci&oacute;n.</em></strong></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p><strong><em>Cuidado del Producto: Se recomienda lavar a mano con suavidad para preservar el brillo y la elegancia del cobre. Evitar el uso de detergentes abrasivos que puedan afectar el acabado.</em></strong></p>', '', 1, 9, 113400.00, NULL, 0, NULL, NULL, NULL, NULL),
(415, 'Set de 4 Copas de Vino Talladas', '1000 01 009-4', NULL, 226200.00, 1, '2020-10-06 14:54:04', '2023-11-23 18:46:13', 111, 2013, '<p><em><strong>Las Copas de Vino Talladas de Cobre Chileno de la marca Perfect Class son una expresi&oacute;n sublime de la elegancia y la artesan&iacute;a de alta calidad. Cada copa es una obra de arte tallada con esmero, fusionando la riqueza del cobre chileno con un dise&ntilde;o tallado que a&ntilde;ade un toque de lujo a cada ocasi&oacute;n.</strong></em></p>\r\n\r\n<p><em><strong>Caracter&iacute;sticas Principales:</strong></em></p>\r\n\r\n<ol>\r\n	<li><em><strong>Tallado Exquisito: Cada copa es meticulosamente tallada por h&aacute;biles artesanos, dando vida a intrincados dise&ntilde;os que resaltan la belleza del cobre. El tallado agrega un nivel de sofisticaci&oacute;n y refinamiento que transforma la experiencia de beber vino en un momento verdaderamente especial.</strong></em></li>\r\n	<li><em><strong>Cobre Chileno de Alta Calidad: Utilizando cobre chileno de la m&aacute;s alta calidad, estas copas no solo destacan por su est&eacute;tica excepcional, sino tambi&eacute;n por su durabilidad y resistencia. La elecci&oacute;n del material asegura que cada copa sea una inversi&oacute;n duradera en elegancia y calidad.</strong></em></li>\r\n	<li><em><strong>Dise&ntilde;o Ergon&oacute;mico: La forma de las copas ha sido cuidadosamente dise&ntilde;ada para proporcionar una experiencia de degustaci&oacute;n &oacute;ptima. El dise&ntilde;o ergon&oacute;mico permite un manejo c&oacute;modo y resalta las caracter&iacute;sticas &uacute;nicas de cada vino.</strong></em></li>\r\n	<li><em><strong>Versatilidad en Ocasiones: Desde cenas &iacute;ntimas hasta celebraciones grandiosas, las Copas de Vino Talladas de Cobre Chileno Perfect Class se adaptan con gracia a cualquier ocasi&oacute;n, convirtiendo cada momento en una celebraci&oacute;n de la elegancia y el buen gusto.</strong></em></li>\r\n	<li><em><strong>Brillo Duradero: El acabado pulido del cobre no solo resalta los intrincados detalles del tallado, sino que tambi&eacute;n proporciona un brillo duradero que perdura a lo largo del tiempo. Estas copas son una joya atemporal que mejora con el paso de los a&ntilde;os.</strong></em></li>\r\n</ol>\r\n\r\n<p><em><strong>Cuidado del Producto: Se recomienda un cuidado delicado al lavar a mano para preservar los detalles tallados y mantener la luminosidad del cobre. Evitar el uso de detergentes abrasivos.</strong></em></p>', '', 1, 10, 226200.00, NULL, 0, NULL, NULL, NULL, NULL),
(416, 'Set de 4 Copas de Vino Alto', '1000 01 008-4', NULL, 194900.00, 1, '2020-10-06 14:55:46', '2024-01-26 10:32:55', 111, 2001, '<p><em><strong>Las Copas de Vino de Cobre Chileno de la marca Perfect Class fusionan la artesan&iacute;a tradicional con la elegancia contempor&aacute;nea. Cada copa es cuidadosamente elaborada utilizando cobre chileno de la m&aacute;s alta calidad, ofreciendo una experiencia &uacute;nica para los amantes del buen vino.</strong></em></p>\r\n\r\n<p><em><strong>Caracter&iacute;sticas Principales:</strong></em></p>\r\n\r\n<ol>\r\n	<li><em><strong>Elegancia sin Igual: La belleza de estas copas radica en su dise&ntilde;o sofisticado y moderno, que a&ntilde;ade un toque de distinci&oacute;n a cualquier ocasi&oacute;n. El cobre pulido refleja la luz de manera sutil, creando una atm&oacute;sfera de refinamiento.</strong></em></li>\r\n	<li><em><strong>Artesan&iacute;a Excepcional: Cada copa es h&aacute;bilmente elaborada por artesanos expertos que han perfeccionado el arte de trabajar el cobre a lo largo de generaciones. El resultado es una obra maestra de artesan&iacute;a que combina la tradici&oacute;n con la excelencia contempor&aacute;nea.</strong></em></li>\r\n	<li><em><strong>Calidad Inigualable: Fabricadas con cobre chileno de primera calidad, estas copas no solo son visualmente impresionantes, sino que tambi&eacute;n ofrecen durabilidad y resistencia. La elecci&oacute;n del material garantiza una experiencia de degustaci&oacute;n &uacute;nica.</strong></em></li>\r\n	<li><em><strong>Dise&ntilde;o Ergon&oacute;mico: La forma de las copas ha sido cuidadosamente dise&ntilde;ada para realzar las caracter&iacute;sticas del vino y permitir un agarre c&oacute;modo. La experiencia de beber se eleva gracias a la ergonom&iacute;a de estas copas.</strong></em></li>\r\n	<li><em><strong>Versatilidad: Ideal para cualquier ocasi&oacute;n, desde cenas &iacute;ntimas hasta celebraciones especiales. Las Copas de Vino de Cobre Chileno Perfect Class complementan tanto ambientes formales como informales con su estilo vers&aacute;til.</strong></em></li>\r\n</ol>\r\n\r\n<p><em><strong>Cuidado del Producto: Se recomienda lavar a mano para preservar la belleza del cobre y mantener la calidad del producto a lo largo del tiempo. Evitar el uso de detergentes abrasivos.</strong></em></p>', '', 1, 10, 194900.00, NULL, 0, NULL, NULL, NULL, NULL);
