(426, 'Botellon de Whisky / Licor Cobre', '1000 01 038', NULL, 132900.00, 1, '2021-01-27 17:59:29', '2023-11-25 12:16:32', 111, 2047, '<p><em><strong>El Botell&oacute;n de Whisky de Cobre Chileno de la marca Perfect Class es la pieza central que redefine la presentaci&oacute;n y el disfrute de tu whisky favorito. Este botell&oacute;n ha sido meticulosamente confeccionado con cobre chileno de la m&aacute;s alta calidad, fusionando la nobleza del material con un dise&ntilde;o elegante que realza la experiencia de servir y degustar el whisky.</strong></em></p>\r\n\r\n<p><em><strong>Caracter&iacute;sticas Principales:</strong></em></p>\r\n\r\n<ol>\r\n	<li><em><strong>Dise&ntilde;o Elegante y Distintivo:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>El dise&ntilde;o del botell&oacute;n refleja la elegancia y distinci&oacute;n propias del mundo del whisky. La combinaci&oacute;n de formas cl&aacute;sicas y detalles contempor&aacute;neos a&ntilde;ade un toque de sofisticaci&oacute;n a cualquier entorno.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>Cobre Chileno de Alta Calidad:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>Fabricado con cobre chileno de primera calidad, este botell&oacute;n destaca por su belleza y durabilidad excepcionales. La elecci&oacute;n del material no solo es est&eacute;tica, sino que tambi&eacute;n influye en la preservaci&oacute;n de las caracter&iacute;sticas del whisky.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>Acabado Pulido y Brillante:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>El acabado pulido del cobre agrega un brillo excepcional al botell&oacute;n, creando una presentaci&oacute;n deslumbrante para tu whisky preferido. La superficie pulida refleja la luz de manera cautivadora, realzando la apreciaci&oacute;n visual de la bebida.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>Capacidad Perfecta para Whisky:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>La capacidad del botell&oacute;n ha sido cuidadosamente calculada para albergar tu whisky de manera &oacute;ptima. Su dise&ntilde;o garantiza que cada vertido sea una experiencia placentera y aut&eacute;ntica.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>Tapa Herm&eacute;ticamente Cerrada:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>La tapa herm&eacute;tica del botell&oacute;n asegura la preservaci&oacute;n de los aromas y sabores del whisky. Este detalle funcional combina la elegancia con la funcionalidad, manteniendo la calidad de tu bebida.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p><em><strong>Cuidado del Producto: Se recomienda limpiar con un pa&ntilde;o suave y h&uacute;medo para mantener el brillo y la elegancia del cobre. Evitar el uso de productos abrasivos que puedan afectar el acabado.</strong></em></p>', '', 1, 15, 132900.00, NULL, 0, NULL, NULL, NULL, NULL),
(427, 'Michael Jackson K9 (5x8x5cms)', 'Michael588', NULL, 8500.00, 1, '2021-02-08 12:02:34', '2023-11-28 17:47:08', 112, 579, '<p><em><strong>El Adorno de Cristal de Alta Pureza con la figura de Michael Jackson en Completo 3D de la marca Perfect Class es una obra maestra que combina la elegancia del cristal con la expresi&oacute;n art&iacute;stica del Rey del Pop. Cada adorno ha sido cuidadosamente elaborado en cristal de alta pureza, ofreciendo una pieza &uacute;nica que rinde homenaje a la leyenda musical en una presentaci&oacute;n tridimensional excepcional.</strong></em></p>\r\n\r\n<p><em><strong>Caracter&iacute;sticas Principales:</strong></em></p>\r\n\r\n<ol>\r\n	<li><em><strong>Figura Completa de Michael Jackson en 3D:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>Este adorno presenta una figura completa de Michael Jackson en una presentaci&oacute;n tridimensional detallada y v&iacute;vida. Cada rasgo del Rey del Pop ha sido grabado con precisi&oacute;n, capturando su esencia y estilo inconfundible.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>Cristal de Alta Pureza:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>El cristal utilizado en este adorno es de alta pureza, conocido por su claridad excepcional. La elecci&oacute;n de este material garantiza la m&aacute;xima transparencia, permitiendo una presentaci&oacute;n n&iacute;tida y brillante de la figura grabada en su interior.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>Grabado Intrincado y Detallado:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>El grabado en el interior del cristal ha sido realizado con intrincados detalles para representar de manera fiel la figura de Michael Jackson. Cada l&iacute;nea y contorno se ha trabajado con precisi&oacute;n para lograr una presentaci&oacute;n 3D aut&eacute;ntica.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>Presentaci&oacute;n Elegante y Sofisticada:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>El adorno se presenta en un dise&ntilde;o elegante y sofisticado, resaltando la figura de Michael Jackson de manera imponente. Su calidad excepcional y presentaci&oacute;n refinada hacen de este adorno una pieza &uacute;nica para admirar y apreciar.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p><em><strong>Cuidado del Producto: Se recomienda limpiar el cristal con un pa&ntilde;o suave y sin pelusa para mantener la claridad y fineza. Evitar el uso de productos qu&iacute;micos fuertes que puedan da&ntilde;ar el cristal o el grabado.</strong></em></p>', '', 1, 20, 8500.00, NULL, 0, NULL, NULL, NULL, NULL),
