(435, 'Cristal de la Armada de Chile', 'CRISTALARMADA1066', NULL, 35000.00, 1, '2021-05-03 16:28:21', '2023-11-28 17:24:22', 112, 860, '<p><em><strong>El Adorno de Cristal de Alta Pureza de la Armada de Chile con un buque en Completo 3D de la marca Perfect Class es una obra de arte que combina la elegancia del cristal con el orgullo y la tradici&oacute;n naval. Cada adorno ha sido minuciosamente confeccionado en cristal de alta pureza, ofreciendo una representaci&oacute;n tridimensional excepcional de la Armada de Chile y su imponente buque.</strong></em></p>\r\n\r\n<p><em><strong>Caracter&iacute;sticas Principales:</strong></em></p>\r\n\r\n<ol>\r\n	<li><em><strong>Figura Completa de la Armada de Chile y Buque en 3D:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>Este adorno presenta una figura tridimensional completa de un buque de la Armada de Chile y, capturando con detalle y precisi&oacute;n la esencia de la instituci&oacute;n naval. Cada elemento, desde la bandera hasta la forma distintiva del buque, se ha grabado con maestr&iacute;a en el interior del cristal.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>Cristal de Alta Pureza:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>El cristal utilizado en este adorno es de alta pureza, conocido por su transparencia excepcional. La elecci&oacute;n de este material asegura una presentaci&oacute;n n&iacute;tida y clara de la figura grabada en su interior, resaltando cada detalle de el buque.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>Grabado 3D Detallado:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>El grabado en el cristal ha sido realizado con detalles intrincados para representar aut&eacute;nticamente los s&iacute;mbolos y la estructura del buque naval. Cada l&iacute;nea, insignia y elemento distintivo se presenta con fidelidad, creando una pieza que rinde homenaje a la nobleza y servicio de la Armada de Chile.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>Presentaci&oacute;n Elegante y Respetuosa:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>El adorno se presenta en un dise&ntilde;o elegante que resalta la figura de la Armada de Chile de manera respetuosa. Su calidad excepcional y presentaci&oacute;n refinada hacen de este adorno una pieza &uacute;nica para aquellos que valoran la historia y la dedicaci&oacute;n naval.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p><em><strong>Cuidado del Producto: Se recomienda limpiar el cristal con un pa&ntilde;o suave y sin pelusa para mantener la claridad y fineza. Evitar el uso de productos qu&iacute;micos fuertes que puedan da&ntilde;ar el cristal o el grabado.</strong></em></p>', '', 1, 10, 35000.00, NULL, 0, NULL, NULL, NULL, NULL),
(436, 'Cristal del Ejercito de Chile', 'CRISTALEJERCITO1066', NULL, 35000.00, 1, '2021-05-03 16:30:21', '2023-11-28 17:31:37', 112, 900, '<p><em><strong>El Adorno de Cristal de Alta Pureza con el grabado en Completo 3D de un Tanque del Ej&eacute;rcito de Chile de la marca Perfect Class es una obra de arte que fusiona la elegancia del cristal con la imponencia y fuerza militar. Cada adorno ha sido meticulosamente elaborado en cristal de alta pureza, ofreciendo una representaci&oacute;n tridimensional excepcional de la maquinaria militar.</strong></em></p>\r\n\r\n<p><em><strong>Caracter&iacute;sticas Principales:</strong></em></p>\r\n\r\n<ol>\r\n	<li>\r\n	<p><em><strong>Figura Completa de Tanque del Ej&eacute;rcito de Chile en 3D:</strong></em></p>\r\n\r\n	<ul>\r\n		<li><em><strong>Este adorno presenta una figura tridimensional completa de un tanque del Ej&eacute;rcito de Chile, capturando con detalle y precisi&oacute;n la esencia de la maquinaria militar. Cada rueda, ca&ntilde;&oacute;n y elemento distintivo se ha grabado con maestr&iacute;a en el interior del cristal.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n	<li>\r\n	<p><em><strong>Cristal de Alta Pureza:</strong></em></p>\r\n\r\n	<ul>\r\n		<li><em><strong>El cristal utilizado en este adorno es de alta pureza, conocido por su transparencia excepcional. La elecci&oacute;n de este material asegura una presentaci&oacute;n n&iacute;tida y clara de la figura grabada en su interior, resaltando cada detalle del tanque y honrando la fortaleza del Ej&eacute;rcito de Chile.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n	<li>\r\n	<p><em><strong>Grabado 3D Detallado:</strong></em></p>\r\n\r\n	<ul>\r\n		<li><em><strong>El grabado en el cristal ha sido realizado con detalles intrincados para representar aut&eacute;nticamente la estructura y caracter&iacute;sticas &uacute;nicas del tanque militar. Cada oruga, insignia y elemento distintivo se presenta con fidelidad, creando una pieza que rinde tributo al compromiso y valent&iacute;a de las fuerzas armadas.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n	<li>\r\n	<p><em><strong>Presentaci&oacute;n Elegante y Respetuosa:</strong></em></p>\r\n\r\n	<ul>\r\n		<li><em><strong>El adorno se presenta en un dise&ntilde;o elegante que resalta la figura del tanque del Ej&eacute;rcito de Chile de manera respetuosa. Su calidad excepcional y presentaci&oacute;n refinada hacen de este adorno una pieza &uacute;nica para aquellos que valoran la historia y el servicio militar.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ol>\r\n\r\n<p><em><strong>Cuidado del Producto: Se recomienda limpiar el cristal con un pa&ntilde;o suave y sin pelusa para mantener la claridad y fineza. Evitar el uso de productos qu&iacute;micos fuertes que puedan da&ntilde;ar el cristal o el grabado.</strong></em></p>', '', 1, 10, 35000.00, NULL, 0, NULL, NULL, NULL, NULL);
