(445, 'Set de 4 Copas Espumante', '1000 01 010-4', NULL, 189900.00, 1, '2021-07-12 20:16:05', '2023-11-23 17:14:15', 111, 2009, '<p><em><strong>Las Copas de Espumante de Cobre Chileno de la marca Perfect Class son la m&aacute;xima expresi&oacute;n de la elegancia y la innovaci&oacute;n en la degustaci&oacute;n de espumantes. Estas copas fusionan la rica tradici&oacute;n artesanal del cobre chileno con un dise&ntilde;o contempor&aacute;neo, creando un accesorio refinado para elevar la experiencia de disfrutar de un espumante de calidad.</strong></em></p>\r\n\r\n<p><em><strong>Caracter&iacute;sticas Principales:</strong></em></p>\r\n\r\n<ol>\r\n	<li><em><strong>Dise&ntilde;o Especializado para Espumantes:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>La forma de las copas ha sido meticulosamente dise&ntilde;ada para resaltar las caracter&iacute;sticas &uacute;nicas de los espumantes. El dise&ntilde;o favorece la conservaci&oacute;n de las burbujas y realza la experiencia de degustaci&oacute;n.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>Cobre Chileno de Alta Calidad:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>Fabricadas con cobre chileno de la m&aacute;s alta calidad, estas copas no solo son visualmente impresionantes, sino que tambi&eacute;n ofrecen durabilidad y resistencia. La elecci&oacute;n del material garantiza una experiencia de degustaci&oacute;n excepcional.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>Acabado Pulido y Brillante:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>El acabado pulido del cobre a&ntilde;ade un brillo excepcional a cada copa, creando un juego de luces y sombras que complementa la efervescencia del espumante. La belleza de estas copas resplandece en cualquier ocasi&oacute;n.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>Ergonom&iacute;a para un Agarre C&oacute;modo:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>El dise&ntilde;o ergon&oacute;mico permite un agarre c&oacute;modo y elegante. La ligereza de las copas facilita el movimiento, realzando la experiencia de disfrutar de un espumante sin esfuerzo.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>Versatilidad en Celebraciones:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>Ideal para celebrar momentos especiales y brindar con estilo. Estas copas son el complemento perfecto para eventos festivos, desde bodas hasta aniversarios, a&ntilde;adiendo un toque de distinci&oacute;n a cada ocasi&oacute;n.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p><em><strong>Cuidado del Producto: Se recomienda lavar a mano con suavidad para preservar el brillo y la elegancia del cobre. Evitar el uso de detergentes abrasivos que puedan afectar el acabado.</strong></em></p>', '', 1, 10, 189900.00, NULL, 0, NULL, NULL, NULL, NULL),
(446, 'Set 2 Copas Martini', '1000 01 122-2', NULL, 97900.00, 1, '2021-07-13 17:57:07', '2023-11-24 21:00:22', 111, 2032, '<p><em><strong>degustaci&oacute;n de c&oacute;cteles. Cada copa ha sido meticulosamente confeccionada en cobre chileno de alta calidad, fusionando el encanto cl&aacute;sico con un dise&ntilde;o contempor&aacute;neo, creando una experiencia &uacute;nica para los amantes de los martinis.</strong></em></p>\r\n\r\n<p><em><strong>Caracter&iacute;sticas Principales:</strong></em></p>\r\n\r\n<ol>\r\n	<li><em><strong>Dise&ntilde;o Cl&aacute;sico y Contempor&aacute;neo:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>La forma atemporal de las copas de martini se combina con un toque contempor&aacute;neo, creando un dise&ntilde;o que destaca en cualquier ocasi&oacute;n. La elegancia del cobre chileno se refleja en cada detalle.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>Cobre Chileno de Alta Calidad:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>Fabricadas con cobre chileno de primera calidad, estas copas destacan por su belleza y durabilidad excepcionales. La elecci&oacute;n del material asegura una experiencia de degustaci&oacute;n &uacute;nica y duradera.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>Acabado Pulido y Brillante:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>El acabado pulido del cobre agrega un brillo excepcional a cada copa, creando un juego de luces y sombras que realza la presentaci&oacute;n de tu martini. La superficie pulida refleja el arte de la artesan&iacute;a en cada sorbo.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>Capacidad Perfecta para Martinis:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\"