(456, 'Set 6 Copones Cerveceros', '1000 01 123-6', NULL, 198900.00, 1, '2021-07-20 21:19:22', '2023-11-25 11:45:38', 111, 2038, '<p><em><strong>Los Copones Cerveceros de Cobre Chileno de la marca Perfect Class son la fusi&oacute;n perfecta entre la tradici&oacute;n del cobre y la experiencia &uacute;nica de disfrutar de una buena cerveza. Cada cop&oacute;n ha sido cuidadosamente confeccionado con cobre chileno de la m&aacute;s alta calidad, ofreciendo un dise&ntilde;o elegante y una funcionalidad excepcional para los amantes de la cerveza.</strong></em></p>\r\n\r\n<p><em><strong>Caracter&iacute;sticas Principales:</strong></em></p>\r\n\r\n<ol>\r\n	<li><em><strong>Dise&ntilde;o Estilizado y Funcional:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>El dise&ntilde;o estilizado de los copones se combina con la funcionalidad para crear una experiencia de degustaci&oacute;n &uacute;nica. La forma del cop&oacute;n resalta las caracter&iacute;sticas y matices de cada cerveza, a&ntilde;adiendo un toque de elegancia a cada sorbo.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>Cobre Chileno de Alta Calidad:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>Fabricados con cobre chileno de primera calidad, estos copones destacan por su belleza y durabilidad excepcionales. La elecci&oacute;n del material asegura una experiencia de degustaci&oacute;n aut&eacute;ntica y duradera.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>Acabado Pulido y Brillante:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>El acabado pulido del cobre agrega un brillo excepcional a cada cop&oacute;n, creando una presentaci&oacute;n deslumbrante para tu cerveza favorita. La superficie pulida refleja la luz de manera cautivadora, realzando la est&eacute;tica de cada momento.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>Capacidad Ideal para Cervezas Especiales:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>La capacidad cuidadosamente seleccionada de cada cop&oacute;n se adapta a una variedad de cervezas, desde artesanales hasta cl&aacute;sicas. Disfruta de la autenticidad de cada tipo de cerveza con estos copones especializados.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>Borde Dise&ntilde;ado para una Degustaci&oacute;n Plena:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>El borde del cop&oacute;n ha sido dise&ntilde;ado para maximizar la experiencia de degustaci&oacute;n, permitiendo que los aromas se liberen y que cada sorbo sea un placer completo. Cada detalle contribuye a la elegancia y funcionalidad del dise&ntilde;o.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p><em><strong>Cuidado del Producto: Se recomienda lavar a mano con suavidad para preservar el brillo y la</strong></em> elegancia del cobre. Evitar el uso de detergentes abrasivos que puedan afectar el acabado.</p>', '', 1, 10, 198900.00, NULL, 0, NULL, NULL, NULL, NULL),
(457, 'Set 6 Vasos Pisco Sour', '1000 01 124-6', NULL, 118900.00, 1, '2021-07-20 21:21:55', '2023-11-25 11:51:32', 111, 2042, '<p><em><strong>Los Vasos de Pisco Sour de Cobre Chileno de la marca Perfect Class son la expresi&oacute;n m&aacute;xima de elegancia y tradici&oacute;n para disfrutar de esta ic&oacute;nica bebida. Cada vaso ha sido meticulosamente confeccionado en cobre chileno de alta calidad, fusionando la riqueza del material con un dise&ntilde;o que realza la experiencia &uacute;nica de degustar un Pisco Sour.</strong></em></p>\r\n\r\n<p><em><strong>Caracter&iacute;sticas Principales:</strong></em></p>\r\n\r\n<ol>\r\n	<li><em><strong>Dise&ntilde;o Cl&aacute;sico y Atemporal:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>El dise&ntilde;o de los vasos refleja la tradici&oacute;n del Pisco Sour, a&ntilde;adiendo un toque cl&aacute;sico y atemporal a cada sorbo. La forma elegante resalta la autenticidad de esta bebida ic&oacute;nica.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>Cobre Chileno de Alta Calidad:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>Fabricados con cobre chileno de primera calidad, estos vasos destacan por su belleza y durabilidad excepcionales. La elecci&oacute;n del material resalta la conexi&oacute;n &uacute;nica con la tradici&oacute;n del Pisco Sour.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>Acabado Pulido y Brillante:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>El acabado pulido del cobre agrega un brillo excepcional a cada vaso, creando una presentaci&oacute;n deslumbrante para tu Pisco Sour. La superficie pulida refleja la luz de manera cautivadora, realzando cada momento de disfrute.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>Capacidad Perfecta para Pisco Sour:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>La capacidad de cada vaso ha sido cuidadosamente seleccionada para resaltar los sabores y aromas del Pisco Sour. Cada sorbo se convierte en una experiencia plena y aut&eacute;ntica.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>Mango Ergon&oacute;mico para un Agarre C&oacute;modo:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>El mango ergon&oacute;mico no solo a&ntilde;ade un toque de estilo, sino que tambi&eacute;n permite un agarre c&oacute;modo y seguro. Disfruta de tu Pisco Sour con elegancia y comodidad.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p><em><strong>Cuidado del Producto: Se recomienda lavar a mano con suavidad para preservar el brillo y la elegancia del cobre. Evitar el uso de detergentes abrasivos que puedan afectar el acabado.</strong></em></p>', '', 1, 5, 118900.00, NULL, 0, NULL, NULL, NULL, NULL),
(458, 'Bandeja de Cobre 30 Cms Diámetro', '1000 01 021', NULL, 107900.00, 1, '2021-08-09 15:39:05', '2023-11-25 11:33:26', 111, 2035, '<p><em><strong>Las Bandejas de Cobre Chileno de la marca Perfect Class son la definici&oacute;n misma de la elegancia funcional. Estas bandejas, confeccionadas con esmero en cobre chileno de alta calidad, no solo sirven como pr&aacute;cticos accesorios para el servicio, sino que tambi&eacute;n a&ntilde;aden un toque de lujo y distinci&oacute;n a cualquier entorno.</strong></em></p>\r\n\r\n<p><em><strong>Caracter&iacute;sticas Principales:</strong></em></p>\r\n\r\n<ol>\r\n	<li><em><strong>Dise&ntilde;o Elegante y Vers&aacute;til:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>Cada bandeja ha sido dise&ntilde;ada con un toque de sofisticaci&oacute;n que se adapta a una variedad de estilos y ocasiones. Desde la presentaci&oacute;n de aperitivos hasta el servicio de bebidas, estas bandejas se destacan por su versatilidad y elegancia atemporal.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>Artesan&iacute;a Excepcional en Cobre Chileno:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>El cobre chileno de alta calidad utilizado en la confecci&oacute;n de estas bandejas resalta la artesan&iacute;a excepcional. Cada detalle, desde los bordes finamente trabajados hasta la superficie pulida, refleja la dedicaci&oacute;n y la destreza de nuestros artesanos.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>Acabado Brillante y Duradero:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>El acabado pulido del cobre proporciona un brillo excepcional que perdura a lo largo del tiempo. Este acabado no solo es est&eacute;ticamente atractivo, sino que tambi&eacute;n facilita la limpieza y el mantenimiento de la bandeja.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>Usos M&uacute;ltiples y Decorativos:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>Ideal para servir bebidas, presentar aperitivos o incluso como un elemento decorativo en s&iacute; mismo. Estas bandejas se adaptan perfectamente a diversas situaciones, aportando un toque de distinci&oacute;n a cada ocasi&oacute;n.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p><em><strong>Cuidado del Producto: Se recomienda limpiar las bandejas con un pa&ntilde;o suave y h&uacute;medo para preservar su brillo y elegancia. Evitar el uso de productos abrasivos que puedan da&ntilde;ar el acabado del cobre.</strong></em></p>', '', 1, 10, 107900.00, NULL, 0, NULL, NULL, NULL, NULL),
