(496, 'Set 4 Vasos Whisky Doble Pared 180ml', '4000 01 001', NULL, 49900.00, 1, '2021-10-26 12:14:44', '2023-02-22 13:24:30', 113, 9000, '<h3><ins><em><strong>Descripci&oacute;n </strong></em></ins></h3>\r\n\r\n<p>Dise&ntilde;o de doble pared con parte inferior convexa que mantiene las bebidas a la temperatura perfecta<br />\r\ny ayuda a airear el mejor escoc&eacute;s, malta simple, bourbons y whisky para liberar aromas y producir un sabor m&aacute;s rico.<br />\r\nElegante pero asequible, Luce el aspecto y la sensaci&oacute;n del cristal de doble fondo.</p>\r\n\r\n<p>-Las bebidas fr&iacute;as permanecen frescas durante un largo tiempo.<br />\r\n-Boca soplada por expertos artesanos.<br />\r\n-Fabricado con vidrio de borosilicato duradero de alta calidad.</p>\r\n\r\n<ul>\r\n	<li>El set incluye:</li>\r\n	<li>2 vasos de whisky de doble pared</li>\r\n	<li>Estuche Metalico&nbsp;</li>\r\n</ul>\r\n\r\n<h3><em><strong>Especificaciones:</strong></em></h3>\r\n\r\n<ul>\r\n	<li>Marca: Qdigital</li>\r\n	<li>Peso (kg): 2</li>\r\n	<li>Tipo de Producto: Qdigital Doble Pared</li>\r\n	<li>Alto (cm): 10</li>\r\n	<li>Ancho (cm): 7</li>\r\n	<li>Di&aacute;metro (cm): 7</li>\r\n	<li>Garant&iacute;a: 1 Mes</li>\r\n	<li>Material: Vidrio</li>\r\n	<li>Modelo: 4000 01 001</li>\r\n	<li>Numero de piezas: 2</li>\r\n</ul>\r\n\r\n<p><em><strong>Cuidados del Producto</strong></em></p>\r\n\r\n<ul>\r\n	<li>Solo Limpiar o lavar sin productos abrasivos</li>\r\n	<li>Usar pa&ntilde;os suaves</li>\r\n</ul>', '61794c1998ad9-ficha-whisky-sensation.jpg', 1, 10, 49900.00, NULL, 0, NULL, NULL, NULL, NULL),
