(560, 'Set 2 Tazas Oslo 200cc', '1000 01 012', NULL, 94900.00, 1, '2022-06-15 14:21:34', '2023-11-26 17:49:53', 111, 2061, '<p><em><strong>El Set de Tazas de Caf&eacute; Oslo con Cucharillas y Platillos de 100% Cobre Chileno de la marca Perfect Class es una experiencia &uacute;nica que combina la tradici&oacute;n del caf&eacute; con la elegancia distintiva del cobre. Cada elemento ha sido meticulosamente confeccionado con cobre chileno de la m&aacute;s alta calidad, ofreciendo un conjunto sofisticado para elevar tus momentos de caf&eacute;.</strong></em></p>\r\n\r\n<p><em><strong>Caracter&iacute;sticas Principales:</strong></em></p>\r\n\r\n<ol>\r\n	<li><em><strong>Dise&ntilde;o Oslo Elegante:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>El set presenta un dise&ntilde;o Oslo distintivo que aporta elegancia y modernidad a tus momentos de caf&eacute;. La forma estilizada y los detalles cuidadosamente trabajados resaltan la belleza del cobre chileno, creando un conjunto &uacute;nico y est&eacute;ticamente agradable.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>100% Cobre Chileno de Alta Pureza:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>Fabricado con cobre chileno de pureza inigualable, cada pieza del set destaca por su autenticidad y durabilidad excepcionales. La elecci&oacute;n del cobre chileno no solo a&ntilde;ade nobleza al dise&ntilde;o, sino que tambi&eacute;n asegura la calidad &uacute;nica de cada elemento.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>Incluye:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>Tazas de Caf&eacute;: Dise&ntilde;adas ergon&oacute;micamente para ofrecer una experiencia de caf&eacute; c&oacute;moda y elegante.</strong></em></li>\r\n		<li><em><strong>Cucharillas: Complementan las tazas con un dise&ntilde;o coordinado y pr&aacute;ctico.</strong></em></li>\r\n		<li><em><strong>Platillos: Proporcionan una base elegante para las tazas y las cucharillas.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>Acabado Pulido y Brillante:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>El acabado pulido del cobre agrega un brillo excepcional al set, creando una presentaci&oacute;n deslumbrante. La superficie pulida refleja la luz de manera cautivadora, resaltando la elegancia de cada detalle.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li><em><strong>Aptas para Bebidas Calientes:</strong></em></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li><em><strong>Las tazas de caf&eacute; est&aacute;n dise&ntilde;adas para resistir temperaturas altas, proporcionando un recipiente seguro y elegante para tus bebidas calientes favoritas.</strong></em></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p><em><strong>Cuidado del Producto: Se recomienda lavar a mano con cuidado utilizando detergentes suaves para preservar el brillo y la elegancia del cobre. Evitar el uso de productos abrasivos que puedan afectar el acabado.</strong></em></p>', '', 1, 5, 94900.00, '', 0, NULL, NULL, NULL, NULL),
