(582, 'Busto Minero (En Bolsa)', '5000 01 013', NULL, 5900.00, 1, '2022-08-05 12:20:12', '2023-11-16 11:54:54', 110, 3054, '<p><em><strong>&quot;Los llaveros cobrizados de la marca Perfect Class son peque&ntilde;as obras maestras que fusionan la elegancia atemporal con la funcionalidad moderna. Cada pieza es m&aacute;s que un simple accesorio; es un testimonio de artesan&iacute;a exquisita y estilo refinado. El resplandor c&aacute;lido y sutil del cobre, cuidadosamente aplicado, confiere a estos llaveros un encanto &uacute;nico que captura la luz de manera delicada, creando destellos que iluminan cada detalle meticulosamente grabado. Perfect Class ha logrado la s&iacute;ntesis perfecta entre belleza y utilidad, transformando estos llaveros en objetos de deseo que no solo guardan llaves, sino tambi&eacute;n momentos especiales. Ll&eacute;valos contigo y experimenta la sensaci&oacute;n de llevar contigo no solo un llavero, sino una obra de arte en cada paso que das&quot;.</strong></em></p>', '', 1, 10, 5900.00, '', 0, NULL, NULL, NULL, NULL),
