(656, 'Copper Reserve Elixir', '5000 06 049', NULL, 46990.00, 1, '2022-10-26 16:55:58', '2024-01-23 18:07:43', 113, 8022, '<p><em><strong>Sum&eacute;rgete en la opulencia del buen whisky con nuestro exclusivo Lujoso Set de Vasos Cobrizados. Este set de edici&oacute;n limitada incluye una Botella de Jack Daniel&#39;s N&deg;7 de 375 ml, una hielera, una pinza cobrizada y cuatro vasos dise&ntilde;ados con maestr&iacute;a, todo presentado en una hermosa maleta con asa.</strong></em></p>\r\n\r\n<p><strong><em>Contenido del Set:</em></strong></p>\r\n\r\n<ol>\r\n	<li><strong><em>Botella de Jack Daniel&#39;s N&deg;7 de 375 ml.</em></strong></li>\r\n	<li><strong><em>Hielera 11 x 11 cms Full Cobrizada</em></strong></li>\r\n	<li><strong><em>Pinza para hielo Cobrizada.</em></strong></li>\r\n	<li><strong><em>Dos vasos&nbsp;cobrizados de alta calidad 350ml&nbsp;</em></strong></li>\r\n</ol>\r\n\r\n<p><em><strong>Caracter&iacute;sticas de los Vasos: Los vasos cobrizados son la esencia misma de la elegancia. Con un dise&ntilde;o meticuloso y un acabado cobrizado distintivo, estos vasos no solo realzan visualmente tu experiencia, sino que tambi&eacute;n mejoran las complejas notas del inconfundible Jack Daniel&#39;s N&deg;7.</strong></em></p>\r\n\r\n<p><em><strong>Botella de Jack Daniel&#39;s N&deg;7: La pieza central de este set es una botella de 375 ml de Jack Daniel&#39;s N&deg;7, un whisky que ha alcanzado la perfecci&oacute;n en sabor y calidad. Disfruta de su suavidad &uacute;nica, con notas de roble y vainilla que deleitar&aacute;n tu paladar.</strong></em></p>\r\n\r\n<p><em><strong>Hielera y Pinza Cobrizadas: La hielera y la pinza cobrizadas a&ntilde;aden un toque funcional y est&eacute;tico a tu experiencia con el whisky. Mant&eacute;n tu bebida a la temperatura perfecta y sirve con estilo utilizando esta combinaci&oacute;n de accesorios cobrizados de alta calidad.</strong></em></p>\r\n\r\n<p><em><strong>Maleta con Asa: Presentado en una elegante maleta con asa, este set no solo es una muestra de lujo, sino tambi&eacute;n una declaraci&oacute;n de buen gusto. La maleta facilita el transporte de este conjunto de lujo y a&ntilde;ade un toque adicional de sofisticaci&oacute;n a tu experiencia.</strong></em></p>\r\n\r\n<p><em><strong>Ideal para los Amantes del Buen Whisky: Este set es el regalo definitivo para los verdaderos conocedores del whisky. Ya sea para celebrar momentos especiales o simplemente para disfrutar de un momento de indulgencia, el Lujoso Set de Vasos Cobrizados con Botella de Jack Daniel&#39;s N&deg;7, Hielera y Pinza es la elecci&oacute;n perfecta.</strong></em></p>\r\n\r\n<p><em><strong>Nota: Disfruta con responsabilidad. Este producto est&aacute; destinado a mayores de edad. &iexcl;Salud y placer en cada sorbo!</strong></em></p>', '', 1, 10, 46990.00, '', 0, NULL, NULL, NULL, NULL),
(657, 'Elegance Bubbly', '5000 04 013', NULL, 28600.00, 1, '2022-10-26 16:58:09', '2024-01-29 18:50:27', 113, 8023, '<p>&nbsp;<strong>Set Charm Wine de Perfect Class: Elegancia Deslumbrante</strong>&nbsp;</p>\r\n\r\n<p>Sum&eacute;rgete en la sofisticaci&oacute;n suprema con nuestro exclusivo set Charm Wine de Perfect Class. Este conjunto exquisito ha sido dise&ntilde;ado para elevar tus momentos especiales a nuevas alturas de elegancia.</p>\r\n\r\n<p>&nbsp;<strong>Contenido del Set:</strong></p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>2 Copas de Espumante Cobrizadas: Estas copas, cuidadosamente elaboradas, destacan por su dise&ntilde;o &uacute;nico y acabado en cobre, brindando un toque de lujo a cada sorbo.</p>\r\n	</li>\r\n	<li>\r\n	<p>1 Botella de Espumante: La bebida perfecta para complementar la excelencia de las copas. Nuestra selecci&oacute;n de espumante es una deliciosa sinfon&iacute;a de sabores que completa la experiencia sensorial.</p>\r\n	</li>\r\n</ul>\r\n\r\n<p>&nbsp;<strong>Marca Perfect Class:</strong> La calidad y el refinamiento son sin&oacute;nimos de Perfect Class. Cada detalle de este set refleja el compromiso de nuestra marca con la excelencia, desde el dise&ntilde;o estilizado hasta la elecci&oacute;n cuidadosa de los materiales.</p>\r\n\r\n<p>&nbsp;<strong>Caracter&iacute;sticas Destacadas:</strong></p>\r\n\r\n<ul>\r\n	<li>Elegancia Cobrizada: El brillo del cobre en las copas a&ntilde;ade un toque distintivo y moderno a tus celebraciones.</li>\r\n	<li>Experiencia Sensorial: Disfruta de la riqueza de aromas y sabores con la selecci&oacute;n premium de nuestro espumante.</li>\r\n</ul>\r\n\r\n<p>Este set Charm Wine de Perfect Class es m&aacute;s que un conjunto de copas y una botella; es una invitaci&oacute;n a sumergirse en la elegancia y a crear recuerdos inolvidables con un toque de distinci&oacute;n. &iexcl;Celebra con estilo! 🌹🍾 #CharmWine #PerfectClassElegance</p>', '', 1, 5, 28600.00, '', 0, NULL, NULL, NULL, NULL),
(658, 'Charm Wine', '5000 05 013', NULL, 27400.00, 1, '2022-10-26 17:00:29', '2024-01-29 18:51:00', 113, 8024, '<p><strong>Set Charm Wine de Perfect Class: Elegancia en Cada Sorbo</strong>&nbsp;</p>\r\n\r\n<p>Descubre la exquisitez de nuestros momentos m&aacute;s finos con el Set Charm Wine de Perfect Class. Este conjunto refinado presenta una fusi&oacute;n &uacute;nica de dise&ntilde;o contempor&aacute;neo y sabores exquisitos, dise&ntilde;ado para elevar tus experiencias a nuevas alturas de elegancia.</p>\r\n\r\n<p>&nbsp;<strong>Contenido del Set:</strong></p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>2 Copas de Espumante Cobrizadas: Cautivadoras y elegantes, estas copas de vidrio destacan por su dise&ntilde;o contempor&aacute;neo y su atractivo acabado cobrizado, a&ntilde;adiendo un toque de glamour a cada brindis.</p>\r\n	</li>\r\n	<li>\r\n	<p>1 Botella de Late Harvest: Disfruta de la dulzura balanceada y la complejidad de nuestro Late Harvest, una selecci&oacute;n cuidadosamente elaborada que complementa a la perfecci&oacute;n la sofisticaci&oacute;n de las copas.</p>\r\n	</li>\r\n</ul>\r\n\r\n<p>&nbsp;<strong>Marca Perfect Class:</strong> Perfect Class es sin&oacute;nimo de excelencia y artesan&iacute;a. Cada elemento de este set refleja la dedicaci&oacute;n de nuestra marca a la calidad y la elegancia, desde el dise&ntilde;o de vanguardia hasta la elecci&oacute;n de los ingredientes m&aacute;s finos.</p>\r\n\r\n<p>&nbsp;<strong>Caracter&iacute;sticas Destacadas:</strong></p>\r\n\r\n<ul>\r\n	<li>Elegancia Cobrizada: Las copas cobrizadas a&ntilde;aden un toque moderno y sofisticado a tu experiencia de degustaci&oacute;n.</li>\r\n	<li>Late Harvest Excepcional: La botella de Late Harvest ofrece una armon&iacute;a &uacute;nica de sabores, creando un momento memorable.</li>\r\n</ul>\r\n\r\n<p>Este Set Charm Wine de Perfect Class no es solo un conjunto de copas y una botella; es una expresi&oacute;n de buen gusto y una invitaci&oacute;n a disfrutar de la vida con elegancia. Celeb