(660, 'Vasos Base Cobrizada + J.D. Honey', '5000 05 021', NULL, 51900.00, 1, '2022-11-10 14:11:58', '2023-11-28 13:26:58', 113, 8026, '<p>Un Regalo Elegante y Lujoso, excelente para darselo a quien mas quieres, Un producto totalmente unico en su tipo!<br />\r\nCelebra con los que m&aacute;s quieres con esta grandios vasos Cobrizada y &nbsp;deja una impresi&oacute;n duradera<br />\r\ncon su decoracion de corte. Adornan Cualquier tipo de mesa y trasmiten la noci&oacute;n de elegancia y lujo</p>\r\n\r\n<p>- El Set incluye:<br />\r\n- 4 Vasos con base Cobrizado<br />\r\n- 1 Jack Daniels&nbsp; Honey 375ml<br />\r\n-Estuche Polimate&nbsp;</p>', NULL, 0, NULL, 51900.00, '', 1, '2023-02-27', '2023-03-05', NULL, NULL),
(661, 'Prensa Francesa + 2 Tazas Cobrizado', '5000 01 043', NULL, 32900.00, 0, '2022-12-11 16:40:01', '2024-02-06 13:31:37', 110, 2091, '<p>Esta Cafetera de Prensa Francesa de 1Lt es parte de nuestra linea cobrizada &nbsp;que ha sido pensada para crear un ambiente &uacute;nico,&nbsp;<br />\r\ncon tonos cobre, que evocan nobleza y calidez. &nbsp;Est&aacute; construida de acero inoxidable terminado en un atractivo color cobre opaco<br />\r\n&nbsp;junto a un recipiente de vidrio de borosilicato resistente a los golpes.&nbsp;</p>\r\n\r\n<p>El set incluye:<br />\r\n-1 Prensa francesa<br />\r\n-2 Tazas de Caf&eacute; Cobrizado&nbsp;<br />\r\n-Estuche Polimate</p>', '63963466d1f42-prensa-francesa-2-tazas.jpg', 0, 0, 32900.00, '', 0, NULL, NULL, NULL, NULL),
(662, 'Set 6 Tazas de Café Radiant Roast', '5000 01 056', NULL, 41300.00, 1, '2022-12-11 16:42:27', '2023-11-18 20:10:08', 110, 2092, '<p><em><strong>Las tazas de caf&eacute;&nbsp;Radiant Roast</strong></em><em><strong> cobrizadas de la marca &quot;Perfect Class&quot; son la definici&oacute;n misma de la elegancia en cada sorbo. Concebidas con precisi&oacute;n y estilo, estas tazas fusionan la funci&oacute;n pr&aacute;ctica con una est&eacute;tica excepcional, ofreciendo una experiencia de caf&eacute; incomparable.</strong></em></p>\r\n\r\n<p><strong>Caracter&iacute;sticas Principales:</strong></p>\r\n\r\n<ol>\r\n	<li><strong>Acabado Cobrizado Distintivo:</strong> El acabado cobrizado de estas tazas no solo agrega un toque de distinci&oacute;n, sino que tambi&eacute;n refleja la artesan&iacute;a excepcional que caracteriza a la marca &quot;Perfect Class&quot;. Cada taza es una obra maestra &uacute;nica, resplandeciendo con elegancia.</li>\r\n	<li><strong>Dise&ntilde;o Ergon&oacute;mico para Disfrute &Oacute;ptimo:</strong> Dise&ntilde;adas para adaptarse perfectamente a la mano, estas tazas ofrecen una experiencia de caf&eacute; c&oacute;moda y placentera. La forma ergon&oacute;mica resalta la atenci&oacute;n al detalle, garantizando momentos de deleite con cada sorbo.</li>\r\n	<li><strong>Elegancia en Cada Detalle:</strong> Desde el borde fino hasta el asa ergon&oacute;mica, cada detalle de estas tazas ha sido cuidadosamente dise&ntilde;ado para transmitir una sensaci&oacute;n de elegancia sin esfuerzo. La sutileza se combina con la funcionalidad para una experiencia completa.</li>\r\n	<li><strong>Durabilidad y Resistencia:</strong> Las tazas &quot;Perfect Class&quot; no solo son un deleite visual, sino que tambi&eacute;n est&aacute;n construidas con materiales de alta calidad que garantizan durabilidad y resistencia. Ideales para un uso diario sin comprometer su elegancia.</li>\r\n</ol>', '', 1, 5, 41300.00, '', 0, NULL, NULL, NULL, NULL),
(663, 'Set 3 Copas Cervecera \"Glow\" 420ml', '5000 01 114', NULL, 49600.00, 1, '2022-12-11 16:45:08', '2024-04-17 18:56:18', 110, 2093, '<p>Las copas cerveceras cobrizadas de la marca &quot;Perfect Class&quot; son la personificaci&oacute;n de la elegancia en cada brindis. Dise&ntilde;adas con maestr&iacute;a y meticulosidad, estas copas fusionan la tradici&oacute;n cervecera con un toque moderno, ofreciendo una experiencia &uacute;nica para los amantes de la cerveza refinada.</p>\r\n\r\n<p><strong>Caracter&iacute;sticas Principales:</strong></p>\r\n\r\n<ol>\r\n	<li><strong>Acabado Cobrizado Excepcional:</strong> El acabado cobrizado de estas copas no solo a&ntilde;ade una est&eacute;tica distintiva, sino que tambi&eacute;n refleja la calidad artesanal que distingue a la marca &quot;Perfect Class&quot;. Cada copa es una obra maestra brillante que destaca en cualquier entorno.</li>\r\n	<li><strong>Dise&ntilde;o Ergon&oacute;mico para Disfrute Pleno:</strong> La forma ergon&oacute;mica de estas copas garantiza una experiencia de degustaci&oacute;n c&oacute;moda y satisfactoria. Desde el primer sorbo hasta el &uacute;ltimo, el dise&ntilde;o cuidadosamente pensado resalta la elegancia sin sacrificar la funcionalidad.</li>\r\n	<li><strong>Detalles Sofisticados:</strong> Cada detalle, desde el borde fino hasta el v&aacute;stago delicadamente trabajado, ha sido concebido con precisi&oacute;n para elevar la experiencia cervecera. La sofisticaci&oacute;n se encuentra en cada curva y contorno, ofreciendo un placer visual y t&aacute;ctil.</li>\r\n</ol>', '', 1, 9, 49600.00, '', 0, NULL, NULL, NULL, NULL),
(664, 'Set 2 Copas Vino Cobrizada 455 ml', '5000 01 123', NULL, 30100.00, 1, '2022-12-11 16:47:09', '2023-12-26 13:54:15', 110, 2094, '<p><em><strong>Las copas de vino cobrizadas de la marca &quot;Perfect Class&quot; son el ep&iacute;tome de la elegancia en la degustaci&oacute;n del vino. Dise&ntilde;adas con maestr&iacute;a y cuidado, estas copas fusionan la tradici&oacute;n vin&iacute;cola con un toque contempor&aacute;neo, ofreciendo una experiencia excepcional para los amantes del buen vino.</strong></em></p>\r\n\r\n<p><em><strong>Caracter&iacute;sticas Principales:</strong></em></p>\r\n\r\n<ol>\r\n	<li>\r\n	<p><em><strong>Acabado Cobrizado Distintivo: El acabado cobrizado de estas copas a&ntilde;ade un elemento de lujo y exclusividad. La singularidad de este acabado no solo embellece la copa, sino que tambi&eacute;n refleja la artesan&iacute;a impecable que caracteriza a la marca &quot;Perfect Class&quot;.</strong></em></p>\r\n	</li>\r\n	<li>\r\n	<p><em><strong>Dise&ntilde;o Ergon&oacute;mico para una Experiencia Plena: La forma ergon&oacute;mica de estas copas est&aacute; dise&ntilde;ada para realzar cada matiz del vino, permitiendo una experiencia de degustaci&oacute;n completa. El dise&ntilde;o no solo es est&eacute;tico, sino que tambi&eacute;n contribuye a la apreciaci&oacute;n sensorial del vino.</strong></em></p>\r\n	</li>\r\n	<li>\r\n	<p><em><strong>Detalles Sofisticados: Desde el tallo fino hasta la curvatura del cuenco, cada detalle ha sido meticulosamente pensado para a&ntilde;adir un toque de sofisticaci&oacute;n. Estas copas capturan la esencia de la elegancia en su forma y estructura, elevando el ritual de la cata de vinos.</strong></em></p>\r\n	</li>\r\n	<li>\r\n	<p><em><strong>Durabilidad y Estilo Duradero: Construidas con materiales de alta calidad, estas copas de vino no solo destacan por su elegancia, sino que tambi&eacute;n resisten el uso regular, manteniendo su atractivo a lo largo del tiempo. Perfectas para eventos especiales o para disfrutar de un vino excepcional en la vida cotidiana.</strong></em></p>\r\n	</li>\r\n</ol>', '', 0, NULL, 30100.00, '', 0, NULL, NULL, NULL, NULL),
(665, 'Set 3 Copas Espumante \"Glow\" 235ml', '5000 01 143', NULL, 40900.00, 1, '2022-12-11 16:49:27', '2024-04-17 18:56:26', 110, 2095, '<p><strong><em>Las copas de espumante cobrizadas de la marca &quot;Perfect Class&quot; son la expresi&oacute;n m&aacute;xima de la elegancia en la celebraci&oacute;n y disfrute del espumante. Dise&ntilde;adas con maestr&iacute;a y refinamiento, estas copas fusionan la tradici&oacute;n efervescente con un toque contempor&aacute;neo, ofreciendo una experiencia de brindis que destila sofisticaci&oacute;n.</em></strong></p>\r\n\r\n<p><strong><em>Caracter&iacute;sticas Principales:</em></strong></p>\r\n\r\n<ol>\r\n	<li><strong><em>Acabado Cobrizado Exquisito: El acabado cobrizado de estas copas no solo a&ntilde;ade un toque de opulencia, sino que tambi&eacute;n refleja la artesan&iacute;a impecable que distingue a la marca &quot;Perfect Class&quot;. Cada copa es una obra maestra reluciente, perfecta para elevar cualquier ocasi&oacute;n especial.</em></strong></li>\r\n	<li><strong><em>Dise&ntilde;o Elegante para una Celebraci&oacute;n Sofisticada: La forma elegante y esbelta de estas copas est&aacute; dise&ntilde;ada para realzar la experiencia de disfrutar del espumante. El dise&ntilde;o estilizado y moderno contribuye a la presentaci&oacute;n visual y al disfrute t&aacute;ctil de cada burbuja efervescente.</em></strong></li>\r\n	<li><strong><em>Detalles Sutiles de Sofisticaci&oacute;n: Desde la base hasta el borde delicadamente curvado, cada detalle ha sido cuidadosamente concebido para a&ntilde;adir un toque de refinamiento. Estas copas capturan la esencia misma de la elegancia en cada centelleo y cada sorbo.</em></strong></li>\r\n	<li><strong><em>Durabilidad y Estilo Duradero: Construidas con materiales de primera calidad, estas copas de espumante no solo resplandecen por su elegancia, sino que tambi&eacute;n resisten el uso frecuente, manteniendo su atractivo a lo largo del tiempo. Perfectas para celebraciones memorables.</em></strong></li>\r\n</ol>', '', 1, 8, 40900.00, '', 0, NULL, NULL, NULL, NULL),
(666, 'Set 3 Copas Coñac \"Glow\" 600ml', '5000 01 153', NULL, 39900.00, 1, '2022-12-11 16:51:28', '2024-04-17 18:56:57', 110, 2096, '<p><em><strong>Las copas de co&ntilde;ac cobrizadas de la marca &quot;Perfect Class&quot; son una oda a la elegancia en la degustaci&oacute;n de co&ntilde;ac. Dise&ntilde;adas con maestr&iacute;a y refinamiento, estas copas fusionan la tradici&oacute;n del co&ntilde;ac con un toque contempor&aacute;neo, ofreciendo una experiencia de cata que destaca por su sofisticaci&oacute;n.</strong></em></p>\r\n\r\n<p><em><strong>Caracter&iacute;sticas Principales:</strong></em></p>\r\n\r\n<ol>\r\n	<li><em><strong>Acabado Cobrizado Distintivo: El acabado cobrizado de estas copas no solo a&ntilde;ade un toque de distinci&oacute;n, sino que tambi&eacute;n refleja la artesan&iacute;a impecable que caracteriza a la marca &quot;Perfect Class&quot;. Cada copa es una pieza &uacute;nica que resplandece con elegancia y estilo.</strong></em></li>\r\n	<li><em><strong>Dise&ntilde;o Elegante para una Degustaci&oacute;n Plena: La forma de estas copas ha sido cuidadosamente dise&ntilde;ada para resaltar los aromas y sabores del co&ntilde;ac. Con un dise&ntilde;o que favorece la liberaci&oacute;n de las complejidades de la bebida, estas copas son el complemento perfecto para una degustaci&oacute;n refinada.</strong></em></li>\r\n	<li><em><strong>Detalles Suntuosos de Sofisticaci&oacute;n: Desde el tallo estilizado hasta el borde sutilmente curvado, cada detalle ha sido meticulosamente pensado para agregar un toque de lujo. Estas copas capturan la esencia misma de la elegancia en cada giro y vuelta.</strong></em></li>\r\n	<li><em><strong>Durabilidad y Estilo Duradero: Construidas con materiales de alta calidad, estas copas de co&ntilde;ac no solo destacan por su elegancia, sino que tambi&eacute;n resisten el uso regular, manteniendo su atractivo a lo largo del tiempo. Perfectas para ocasiones especiales y noches de degustaci&oacute;n inolvidables.</strong></em></li>\r\n</ol>', '', 1, 10, 39900.00, '', 0, NULL, NULL, NULL, NULL),
(667, 'Set 4 Copas Vino Pie Cobrizado 350ml', '5000 01 164', NULL, 48300.00, 1, '2022-12-11 16:53:57', '2023-11-22 13:40:27', 110, 2097, '<p>Celebra con los que m&aacute;s quieres con esta grandiosa copa de Vino Cobrizada y &nbsp;deja una impresi&oacute;n duradera<br />\r\ncon su decoracion de corte. Adornan Cualquier tipo de mesa y trasmiten la noci&oacute;n de elegancia y lujo</p>\r\n\r\n<p>El set incluye:<br />\r\n-4 Copas Vino Pie Cobrizado &nbsp;y base biselada 350ml<br />\r\n-Estuche Polimate</p>', '6396390f42468-4-copas-vino-350-ml.jpg', 0, NULL, 48300.00, '', 0, NULL, NULL, NULL, NULL),
(668, 'Set 3 Copas Martini \"Glow\"  274ml', '5000 01 136', NULL, 41800.00, 1, '2022-12-11 16:55:27', '2024-04-17 18:36:47', 110, 2098, '<p><em><strong>Las copas de Martini cobrizadas de la marca &quot;Perfect Class&quot; encarnan la m&aacute;xima elegancia en la experiencia de disfrutar de un Martini. Con un dise&ntilde;o cuidadosamente elaborado y un toque contempor&aacute;neo, estas copas fusionan la tradici&oacute;n del Martini con un estilo distintivo, ofreciendo una experiencia de c&oacute;ctel que destila sofisticaci&oacute;n.</strong></em></p>\r\n\r\n<p><em><strong>Caracter&iacute;sticas Principales:</strong></em></p>\r\n\r\n<ol>\r\n	<li><em><strong>Acabado Cobrizado Exclusivo: El acabado cobrizado de estas copas no solo aporta un toque de exclusividad, sino que tambi&eacute;n refleja la artesan&iacute;a excepcional que distingue a la marca &quot;Perfect Class&quot;. Cada copa es una joya reluciente que realza la presentaci&oacute;n de cualquier Martini.</strong></em></li>\r\n	<li><em><strong>Dise&ntilde;o Elegante para una Experiencia Sofisticada: La forma estilizada y delicada de estas copas est&aacute; dise&ntilde;ada para realzar la presentaci&oacute;n y disfrute del Martini. El dise&ntilde;o favorece la apreciaci&oacute;n visual de los matices del c&oacute;ctel, contribuyendo a una experiencia de degustaci&oacute;n &uacute;nica.</strong></em></li>\r\n	<li><em><strong>Detalles Suntuosos de Sofisticaci&oacute;n: Desde el tallo esbelto hasta el borde sutilmente curvado, cada detalle ha sido meticulosamente pensado para agregar un toque de lujo. Estas copas capturan la esencia misma de la elegancia en cada giro y brindis.</strong></em></li>\r\n	<li><em><strong>Durabilidad y Estilo Duradero: Construidas con materiales de alta calidad, estas copas de Martini no solo resplandecen por su elegancia, sino que tambi&eacute;n resisten el uso regular, manteniendo su atractivo a lo largo del tiempo. Perfectas para ocasiones especiales y encuentros sofisticados.</strong></em></li>\r\n</ol>', '', 1, 5, 41800.00, '', 0, NULL, NULL, NULL, NULL),
(669, 'Set Asado Cobrizado 4 Piezas', '5000 01 042', NULL, 16990.00, 1, '2022-12-11 16:57:04', '2024-03-27 16:46:17', 110, 2099, '<p>Introducimos el conjunto esencial para los amantes del asado: el Set de Asado Cobrizado Perfect Class. Este elegante kit incluye una esp&aacute;tula, un tenedor, un cuchillo y una tenaza, todo cuidadosamente dise&ntilde;ado para ofrecer un rendimiento excepcional en cada barbacoa. Con un revestimiento cobrizado que no solo a&ntilde;ade un toque de estilo, sino que tambi&eacute;n garantiza durabilidad y resistencia a la corrosi&oacute;n, este conjunto es imprescindible para cualquier parrillero aficionado. Adem&aacute;s, viene presentado en un estuche negro con cierre, ideal para transportarlo de manera segura y mantener todas las herramientas organizadas. Domina el arte del asado con el Set de Asado Cobrizado Perfect Class, donde la calidad y el estilo se unen para brindarte una experiencia culinaria sin igual.</p>', NULL, 1, 10, 16990.00, '', 0, NULL, NULL, NULL, NULL),
