(676, 'Set 2 Copas Vino Pie Cobrizado 350ml', '5000 03 162', NULL, 24900.00, 1, '2022-12-11 17:10:47', '2023-11-22 13:40:36', 110, 2106, '<p>Celebra con los que m&aacute;s quieres con esta grandiosa copa de Vino Cobrizada y &nbsp;deja una impresi&oacute;n duradera<br />\r\ncon su decoracion de corte. Adornan Cualquier tipo de mesa y trasmiten la noci&oacute;n de elegancia y lujo</p>\r\n\r\n<p>El set incluye:<br />\r\n-2 Copas Vino Pie Cobrizado &nbsp;y base biselada 350ml<br />\r\n-Estuche Carton</p>', '63964214107c4-2-copas-vino-350-m-estuche.jpg', 0, NULL, 24900.00, '', 0, NULL, NULL, NULL, NULL),
