(681, 'Gentleman\'s Choice', '4000 08 001', NULL, 62300.00, 1, '2023-02-06 16:50:10', '2024-05-02 15:35:34', 113, 8027, '<p><em><strong>Experimenta la m&aacute;xima sofisticaci&oacute;n con nuestro Lujoso Set Gentleman&#39;s Choice. Esta edici&oacute;n exclusiva incluye una Botella de Gentleman Jack y una miniatura de Jack Single Barrel de 50 ml, acompa&ntilde;adas por cuatro vasos de alta calidad, todo presentado en una hermosa maleta con asa.</strong></em></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><em><strong>Contenido del Set:</strong></em></p>\r\n\r\n<ol>\r\n	<li><em><strong>Una Botella de Gentleman Jack&nbsp;de 375 ml.</strong></em></li>\r\n	<li><em><strong>Una Botella Miniatura de Jack Single Barrel de 50 ml.</strong></em></li>\r\n	<li><em><strong>Dos vasos&nbsp;Whisky Doble Pared 180ml&nbsp;</strong></em></li>\r\n</ol>\r\n\r\n<p><em><strong>&nbsp;Eleva tu experiencia de degustaci&oacute;n con estos vasos que no solo son est&eacute;ticamente atractivos, sino que tambi&eacute;n realzan las notas distintivas de Gentleman Jack y Jack Single Barrel.</strong></em></p>\r\n\r\n<p><em><strong>Botella de Gentleman Jack: La pieza central de este set es la Botella de Gentleman Jack, un whisky excepcionalmente suave y equilibrado. Disfruta de la elegancia y la complejidad de este whisky &uacute;nico, destilado dos veces y filtrado a trav&eacute;s de carb&oacute;n de arce.</strong></em></p>\r\n\r\n<p><em><strong>Miniatura de Jack Single Barrel: Descubre la exclusividad con la miniatura de Jack Single Barrel de 50 ml, un whisky meticulosamente seleccionado de un solo barril. Cada sorbo revela la singularidad y la riqueza de este destilado &uacute;nico.</strong></em></p>\r\n\r\n<p><em><strong>Maleta con Asa: Presentado en una impresionante maleta con asa, este set no solo es un regalo, es una declaraci&oacute;n de estilo y refinamiento. La maleta facilita el transporte y a&ntilde;ade un toque de elegancia a cualquier ocasi&oacute;n.</strong></em></p>\r\n\r\n<p><em><strong>Ideal para los Amantes del Buen Whisky: Este set ha sido dise&ntilde;ado pensando en los verdaderos aficionados al whisky. Ya sea para disfrutar en solitario o compartir con amigos, el Lujoso Gentleman&#39;s Choice con Botella de Gentleman Jack y Miniatura de Jack Single Barrel es la elecci&oacute;n perfecta para aquellos que aprecian la calidad excepcional.</strong></em></p>\r\n\r\n<p><em><strong>Nota: Disfruta con responsabilidad. Este producto est&aacute; destinado a mayores de edad. &iexcl;Brinda con estilo y vive la experiencia &uacute;nica de Gentleman Jack y Jack Single Barrel!</strong></em></p>', NULL, 0, NULL, 62300.00, '', 0, NULL, NULL, NULL, NULL),
