(683, 'Jack Legacy Edition', '5000 07 049', NULL, 41900.00, 1, '2023-02-06 17:40:23', '2024-01-23 18:08:13', 113, 8029, '<p><strong><em>Sum&eacute;rgete en la experiencia definitiva para los amantes del buen whisky con nuestro exclusivo Lujoso Set Jack Legacy Edition</em></strong><strong><em>. El cual&nbsp;incluye, Cinco Botellitas de 5 ml y 2 vasos Cobrizados con exquisita atenci&oacute;n al detalle.</em></strong></p>\r\n\r\n<p><strong><em>Contenido del Set:</em></strong></p>\r\n\r\n<ol>\r\n	<li><strong><em>Jack Daniel&#39;s&nbsp; Honey&nbsp; Miniatura de 50ml.</em></strong></li>\r\n	<li><strong><em>Jack Daniel&#39;s&nbsp; Fire Miniatura de 50ml.</em></strong></li>\r\n	<li><strong><em>Jack Daniel&#39;s&nbsp; Apple Miniatura de 50ml.</em></strong></li>\r\n	<li><strong><em>Jack Daniel&#39;s&nbsp; N&deg; 7 Miniatura de 50ml.</em></strong></li>\r\n	<li><strong><em>Jack Daniel&#39;s&nbsp; Single Barrel Miniatura de 50ml.</em></strong></li>\r\n	<li><strong><em>Dos vasos&nbsp;cobrizados de alta calidad 350ml&nbsp;</em></strong></li>\r\n</ol>\r\n\r\n<p><strong><em>Caracter&iacute;sticas de los Vasos:</em></strong></p>\r\n\r\n<ul>\r\n	<li><strong><em>Dise&ntilde;o elegante y exclusivo.</em></strong></li>\r\n	<li><strong><em>Fabricados con materiales de primera calidad.</em></strong></li>\r\n	<li><strong><em>Acabado cobrizado para resaltar la sofisticaci&oacute;n.</em></strong></li>\r\n	<li><strong><em>Capacidad perfecta para disfrutar del whisky en su m&aacute;xima expresi&oacute;n.</em></strong></li>\r\n</ul>\r\n\r\n<p><strong><em>Botella de Jack Daniel&#39;s:</em></strong></p>\r\n\r\n<ul>\r\n	<li><strong><em>Botella de 5ml de uno de los whiskies m&aacute;s reconocidos a nivel mundial.</em></strong></li>\r\n	<li><strong><em>Sabor inconfundible y suave, con notas distintivas de roble y vainilla.</em></strong></li>\r\n</ul>\r\n\r\n<p><strong><em>Presentaci&oacute;n:</em></strong></p>\r\n\r\n<ul>\r\n	<li><strong><em>El set viene presentado en una hermosa maleta con asa, perfe