(686, 'Espejo Cobrizado + Bolsa Terciopelo', '5000 01 050', NULL, 9900.00, 1, '2023-02-27 15:28:12', '2024-04-14 12:24:09', 110, 3033, '<p>Descubre la belleza en cada detalle con el espejo de mano cobrizado de Perfect Class. Este exquisito accesorio presenta un dise&ntilde;o &uacute;nico con doble espejo, uno en cada tapa, que te permite obtener una visi&oacute;n completa y detallada desde cualquier &aacute;ngulo. Su acabado cobrizado a&ntilde;ade un toque de elegancia y sofisticaci&oacute;n a tu rutina diaria de cuidado personal. Adem&aacute;s, viene acompa&ntilde;ado de una bolsa de terciopelo, que no solo lo protege, sino que tambi&eacute;n realza su encanto, convirti&eacute;ndolo en un imprescindible para llevar contigo donde quiera que vayas. Experimenta la perfecci&oacute;n en cada reflejo con el espejo de mano cobrizado de Perfect Class.</p>', NULL, 1, 30, 9900.00, '', 0, NULL, NULL, NULL, NULL),
(687, 'Vasos Legends Of Rock', '3000 03 024', NULL, 18100.00, 1, '2023-03-21 14:50:17', '2024-01-25 02:16:59', 112, 6018, '<p>Sobrevive a este calor &nbsp;con los vasos de las bandas m&aacute;s ic&oacute;nicas de toda la historia. Salud por su legado y por que desde siempre nos han acompa&ntilde;ado. Nos hacen vibrar con sus canciones y llegan a millones de personas alrededor del mundo, y hoy las recopilamos en este set con 4 incre&iacute;bles dise&ntilde;os para homenajearlas&nbsp;<br />\r\n<br />\r\nEl set incluye:<br />\r\n<br />\r\n- 4 vasos grabados ( QUEEN / PINK FLOYD / METALLICA / IRON MAIDEN)<br />\r\n-Maleta de cart&oacute;n, ideal para regalar.<br />\r\n<br />\r\nA solo: $15.990<br />\r\n<br />\r\n&nbsp;</p>', NULL, 1, 6, 18100.00, '', 0, NULL, NULL, '2023-11-24', '2023-11-26'),
