(707, 'Descorchador Cobrizado 2 Alas', '5000 02 045', NULL, 13990.00, 1, '2023-10-12 11:19:24', '2024-03-27 11:14:27', 110, 2108, '<p>Descubre una forma elegante y eficiente de abrir tus botellas de vino con el descorchador de 2 alas cobrizado de Perfect Class. Este sofisticado utensilio combina funcionalidad y estilo, ofreci&eacute;ndote una experiencia de descorche sin esfuerzo. Su dise&ntilde;o de dos alas proporciona un agarre seguro y facilita la extracci&oacute;n del corcho con suavidad y precisi&oacute;n. El acabado cobrizado a&ntilde;ade un toque de distinci&oacute;n a tu barra de vinos o cocina, mientras que su construcci&oacute;n duradera garantiza un uso prolongado. Disfruta de cada momento al descorchar tu vino favorito con el descorchador cobrizado de 2 alas de Perfect Class.</p>', NULL, 1, 20, 13990.00, '', 0, NULL, NULL, NULL, NULL),
(708, 'Multiherramienta Cobrizada', '5000 02 044', NULL, 13990.00, 1, '2023-10-12 11:23:05', '2024-03-27 11:53:10', 110, 2109, '<p>Descubre la versatilidad en la palma de tu mano con la multiherramienta cobrizada de 11 piezas de Perfect Class. Este ingenioso dispositivo re&uacute;ne once herramientas esenciales en un dise&ntilde;o compacto y elegante. Desde destornilladores hasta abrebotellas, pasando por cuchillas y limas, esta multiherramienta te ofrece todo lo que necesitas para hacer frente a cualquier tarea cotidiana o emergencia. Su acabado cobrizado no solo a&ntilde;ade un toque de estilo, sino que tambi&eacute;n proporciona durabilidad y resistencia a la corrosi&oacute;n. Ya sea en casa, en el trabajo o en tus aventuras al aire libre, esta multiherramienta ser&aacute; tu compa&ntilde;era confiable en todo momento. Domina cualquier desaf&iacute;o con la multiherramienta cobrizada de 11 piezas de Perfect Class.</p>', NULL, 1, 20, 13990.00, '', 0, NULL, NULL, NULL, NULL),
(709, 'Set de Manicure 3 Piezas Cobrizado', '5000 02 047', NULL, 10990.00, 1, '2023-10-12 11:26:35', '2024-03-27 11:59:45', 110, 2110, '<p>Perfecciona tu estilo con el set de manicure de 3 piezas cobrizas de Perfect Class. Este conjunto elegante y funcional incluye dos cortau&ntilde;as de diferentes tama&ntilde;os para adaptarse a tus necesidades, junto con unas tijeras de precisi&oacute;n. El acabado cobrizo a&ntilde;ade un toque de sofisticaci&oacute;n a tu kit de cuidado personal, mientras que la calidad y durabilidad de los materiales garantizan un rendimiento excepcional. Ya sea en casa o de viaje, este set de manicure te proporcionar&aacute; las herramientas necesarias para mantener tus u&ntilde;as impecables en todo momento. Eleva tu rutina de belleza con el set de manicure de 3 piezas cobrizas de Perfect Class.</p>', NULL, 1, 20, 10990.00, '', 0, NULL, NULL, NULL, NULL),
(710, 'Destapador Botella Modelo Pala', '5000 02 046', NULL, 10990.00, 1, '2023-10-12 11:31:15', '2024-03-27 12:05:16', 110, 2111, '<p>Abre tus bebidas con estilo y facilidad con el destapador de botella en forma de pala cobrizada de Perfect Class. Esta ingeniosa herramienta combina funcionalidad y dise&ntilde;o &uacute;nico, ofreci&eacute;ndote una manera divertida y pr&aacute;ctica de destapar tus botellas favoritas. Elaborado con un acabado cobrizado que a&ntilde;ade un toque de elegancia, este destapador es tanto un accesorio pr&aacute;ctico como una pieza de conversaci&oacute;n. Su forma ergon&oacute;mica garantiza un agarre c&oacute;modo y seguro, mientras que su duradera construcci&oacute;n asegura un uso prolongado. Disfruta de cada ocasi&oacute;n con el destapador de botella en forma de pala cobrizada de Perfect Class, el complemento perfecto para tu barra de bebidas.</p>', NULL, 1, 20, 10990.00, '', 0, NULL, NULL, NULL, NULL),
(711, 'Botella Termica Cobrizada', '5000 02 042', NULL, 13990.00, 1, '2023-10-12 11:37:30', '2024-03-26 15:59:54', 110, 2112, '<p>Descubre el equilibrio perfecto entre estilo y funcionalidad con la botella t&eacute;rmica cobrizada de Perfect Class. Dise&ntilde;ada para mantener tus bebidas calientes o fr&iacute;as durante horas, esta botella redefine la experiencia de hidrataci&oacute;n tanto en interiores como en exteriores.</p>\r\n\r\n<p>Con un revestimiento de cobrizada&nbsp;de alta calidad, esta botella t&eacute;rmica no solo preserva la temperatura de tus bebidas, sino que tambi&eacute;n ofrece propiedades antibacterianas y antioxidantes, garantizando una hidrataci&oacute;n segura y saludable en todo momento.</p>\r\n\r\n<p>Su construcci&oacute;n de doble pared y aislamiento al vac&iacute;o asegura que tu caf&eacute; matutino se mantenga caliente durante esas largas jornadas laborales, mientras que tu agua helada permanece refrescante durante esas sesiones de entrenamiento intenso en el gimnasio o al aire libre.</p>\r\n\r\n<p>El dise&ntilde;o elegante y ergon&oacute;mico de la botella la hace f&aacute;cil de transportar y c&oacute;moda de sostener, mientras que su tapa herm&eacute;tica evita derrames no deseados, permiti&eacute;ndote disfrutar de tus bebidas favoritas sin preocupaciones, ya sea en la oficina, en el camino o en tus aventuras al aire libre.</p>\r\n\r\n<p>&nbsp;</p>', NULL, 1, 20, 13990.00, '', 0, NULL, NULL, NULL, NULL),
(712, 'Termo Hermetico Cobrizado', '5000 02 041', NULL, 12990.00, 1, '2023-10-12 11:41:05', '2024-03-26 19:27:03', 110, 2113, '<p>&iexcl;Mant&eacute;n tus bebidas calientes o fr&iacute;as durante horas con el termo cobrizado de Perfect Class! Dise&ntilde;ado con elegancia y funcionalidad en mente, nuestro termo combina estilo y rendimiento de primera calidad para satisfacer tus necesidades diarias.</p>\r\n\r\n<p>Construido con materiales de alta calidad y recubierto con un elegante acabado cobrizado, este termo no solo es una declaraci&oacute;n de estilo, sino que tambi&eacute;n ofrece una durabilidad excepcional y una resistencia superior a la corrosi&oacute;n.</p>\r\n\r\n<p>Ya sea que necesites mantener tu caf&eacute; caliente durante esas largas jornadas laborales o disfrutar de una bebida refrescante en tus aventuras al aire libre, el termo Perfect Class es tu compa&ntilde;ero perfecto. Su dise&ntilde;o aislado al vac&iacute;o asegura que tus bebidas se mantengan a la temperatura deseada por m&aacute;s tiempo, mientras que su tapa a prueba de fugas garantiza una experiencia sin derrames en movimiento.</p>\r\n\r\n<p>Con un dise&ntilde;o elegante y ergon&oacute;mico, nuestro termo es ideal para uso diario en el hogar, la oficina, el gimnasio o cualquier otra actividad. &Uacute;nete a la tendencia del cobre y eleva tu estilo con el termo Perfect Class.</p>\r\n\r\n<p>&iexcl;Hazte con el tuyo hoy mismo y descubre por qu&eacute; los amantes del buen gusto eligen Perfect Class para sus necesidades de termos!</p>', NULL, 1, 20, 12990.00, '', 0, NULL, NULL, NULL, NULL),
(713, 'Set 4 Vasos Piscoleros \" Ember\" 500ml', '5000 03 048', NULL, 44900.00, 1, '2023-11-02 11:23:21', '2024-04-17 18:57:24', 110, 2114, '<p><em><strong>Los vasos piscoleros cobrizados de la marca &quot;Perfect Class&quot; son la esencia misma de la elegancia en la experiencia de disfrutar de un buen pisco. Con un dise&ntilde;o meticuloso y un toque contempor&aacute;neo, estos vasos fusionan la tradici&oacute;n del pisco con un estilo distintivo, ofreciendo una experiencia de degustaci&oacute;n que destila sofisticaci&oacute;n.</strong></em></p>\r\n\r\n<p><em><strong>Caracter&iacute;sticas Principales:</strong></em></p>\r\n\r\n<ol>\r\n	<li><em><strong>Acabado Cobrizado Exquisito: El acabado cobrizado de estos vasos no solo agrega un toque de distinci&oacute;n, sino que tambi&eacute;n refleja la artesan&iacute;a excepcional que caracteriza a la marca &quot;Perfect Class&quot;. Cada vaso es una joya reluciente que resalta la presentaci&oacute;n del pisco.</strong></em></li>\r\n	<li><em><strong>Dise&ntilde;o Elegante para una Degustaci&oacute;n Sofisticada: La forma sutil y equilibrada de estos vasos est&aacute; dise&ntilde;ada para realzar la experiencia de disfrutar de un pisco. El dise&ntilde;o favorece la apreciaci&oacute;n visual de los matices de esta bebida &uacute;nica, contribuyendo a una experiencia de degustaci&oacute;n inigualable.</strong></em></li>\r\n	<li><em><strong>Detalles Suntuosos de Sofisticaci&oacute;n: Desde el cuerpo del vaso hasta el borde cuidadosamente trabajado, cada detalle ha sido meticulosamente pensado para agregar un toque de lujo. Estos vasos capturan la esencia misma de la elegancia en cada sorbo.</strong></em></li>\r\n	<li><em><strong>Durabilidad y Estilo Duradero: Construidos con materiales de alta calidad, estos vasos piscoleros no solo resplandecen por su elegancia, sino que tambi&eacute;n resisten el uso regular, manteniendo su atractivo a lo largo del tiempo. Ideales para momentos de celebraci&oacute;n y encuentros con amigos.</strong></em></li>\r\n</ol>', NULL, 1, 19, 40900.00, '', 0, NULL, NULL, NULL, NULL),
(714, 'Set 6 Vasos Whisky \"Ember\" 350ml', '5000 03 049', NULL, 65900.00, 1, '2023-11-02 12:03:11', '2024-04-17 18:57:33', 110, 2115, '<p><em><strong>Los vasos de whisky cobrizados de la marca &quot;Perfect Class&quot; son el ep&iacute;tome de la elegancia en la degustaci&oacute;n de un buen whisky. Con un dise&ntilde;o meticuloso y un toque contempor&aacute;neo, estos vasos fusionan la tradici&oacute;n del whisky con un estilo distintivo, ofreciendo una experiencia de degustaci&oacute;n que destila sofisticaci&oacute;n.</strong></em></p>\r\n\r\n<p><em><strong>Caracter&iacute;sticas Principales:</strong></em></p>\r\n\r\n<ol>\r\n	<li><em><strong>Acabado Cobrizado Exquisito: El acabado cobrizado de estos vasos no solo agrega un toque de distinci&oacute;n, sino que tambi&eacute;n refleja la artesan&iacute;a excepcional que caracteriza a la marca &quot;Perfect Class&quot;. Cada vaso es una obra maestra reluciente que resalta la tonalidad y textura del whisky.</strong></em></li>\r\n	<li><em><strong>Dise&ntilde;o Elegante para una Degustaci&oacute;n Sofisticada: La forma equilibrada y ergon&oacute;mica de estos vasos est&aacute; dise&ntilde;ada para realzar la experiencia de disfrutar de un buen whisky. El dise&ntilde;o favorece la apreciaci&oacute;n visual de los matices de esta bebida &uacute;nica, contribuyendo a una experiencia de degustaci&oacute;n inigualable.</strong></em></li>\r\n	<li><em><strong>Detalles Suntuosos de Sofisticaci&oacute;n: Desde el v&aacute;stago hasta el borde delicadamente trabajado, cada detalle ha sido meticulosamente pensado para agregar un toque de lujo. Estos vasos capturan la esencia misma de la elegancia en cada sorbo.</strong></em></li>\r\n	<li><em><strong>Durabilidad y Estilo Duradero: Construidos con materiales de alta calidad, estos vasos de whisky no solo resplandecen por su elegancia, sino que tambi&eacute;n resisten el uso regular, manteniendo su atractivo a lo largo del tiempo. Ideales para momentos de reflexi&oacute;n y encuentros &iacute;ntimos.</strong></em></li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>', NULL, 1, 20, 65900.00, '', 0, NULL, NULL, NULL, NULL);
