asta celebraciones formales, estas copas de vino cobrizadas son el complemento perfecto para cualquier ocasi&oacute;n especial.</li>\r\n	<li>Viajes y reuniones: La maleta compacta y elegante te permite llevar tus copas de vino favoritas contigo a donde quiera que vayas, asegurando que siempre est&eacute;s listo para brindar con estilo.</li>\r\n</ul>\r\n\r\n<p>Eleva tu experiencia de degustaci&oacute;n con nuestras copas de vino cobrizadas en maleta Perfect Class. &iexcl;Descubre la combinaci&oacute;n perfecta de estilo y calidad hoy mismo!</p>', NULL, 0, NULL, 30900.00, '', 0, NULL, NULL, NULL, NULL),
(742, 'Set 2 Vasos Volver al Futuro', '3000 03 070', NULL, 12500.00, 1, '2024-02-26 15:15:12', '2024-02-26 15:18:47', 112, 6022, '<p>&nbsp;&iexcl;Viaja en el tiempo con estilo! &nbsp;Disfruta de tus piscoleros favoritos con nuestro nuevo set de 2 vasos de 450ml con dise&ntilde;o de &quot;Volver al Futuro&quot; por solo $9.900 CLP. &iexcl;Revive la nostalgia y haz tus reuniones a&uacute;n m&aacute;s &eacute;picas! &nbsp;#VolverAlFuturo #Piscolero450ml #Nostalgia #DeLoreanDrink #OfertaEspecial #TimeTravelInStyle</p>\r\n\r\n<p>Incluye:</p>\r\n\r\n<p>-2 Vasos Piscoleros Volver Al Futuro 450ml&nbsp;</p>\r\n\r\n<p>-Estuche de cart&oacute;n Ecol&oacute;gico.</p>', NULL, 1, 20, 12500.00, '', 0, NULL, NULL, NULL, NULL),
(743, 'Garza Cervecera Red Hot Chili Peppers', '3000 03 071', NULL, 9900.00, 1, '2024-03-06 17:56:54', '2024-03-09 17:32:19', 112, 6023, '<p>🤘 &iexcl;Rockea tus bebidas con nuestro set de 2 garzas cerveceras inspiradas en la legendaria banda de rock Rethotchillipeppers! 🍻 Con capacidad para 415ml cada una, estas garzas son imprescindibles para cualquier fan&aacute;tico de la buena m&uacute;sica y la buena cerveza. 🎸 Fabricadas con materiales de primera calidad, garantizan un estilo &uacute;nico en cada sorbo. &iquest;Listo para llevar tu experiencia cervecera al siguiente nivel? &iexcl;Hazte con nuestro set ahora mismo! 🛒 #Rethotchillipeppers #GarzasCerveceras #RockAndBeer #Estilo&Uacute;nico</p>\r\n\r\n<p>Incluye:</p>\r\n\r\n<p>-2 Garzas Cerveceras Con Dise&ntilde;o Red Hot Chili Peppers 415ml</p>\r\n\r\n<p>-Estuche de cart&oacute;n Ecol&oacute;gico.</p>', NULL, 1, 4, 9900.00, '', 0, NULL, NULL, NULL, NULL),
(744, 'Set 2 Vasos Los Bunkers', '4000 03 071', NULL, 9900.00, 1, '2024-04-02 11:49:05', '2024-04-02 11:50:32', 112, 5019, '<p>&quot;&iexcl;Celebra el legado musical de la banda chilena &quot;Los Bunkers&quot; con nuestro exclusivo set de 2 vasos, grabados con las mejores canciones del grupo! Presentado en un elegante estuche, este conjunto de vasos de la marca Perfect Class es el regalo ideal para los verdaderos fan&aacute;ticos de la m&uacute;sica. Disfruta de tus bebidas favoritas mientras te sumerges en los sonidos distintivos de &quot;Los Bunkers&quot;, creando momentos inolvidables con estilo y elegancia. Haz que cada brindis sea una experiencia &uacute;nica con este exclusivo tributo a una de las bandas m&aacute;s emblem&aacute;ticas de Chile. &iexcl;Hazte con tu set hoy y lleva la pasi&oacute;n musical a otro nivel!&quot;</p>\r\n\r\n<p>El Set Incluye:</p>\r\n\r\n<p>- 2 Vasos 450ml&nbsp; Grabados Con las Canciones de Los Bunkers</p>\r\n\r\n<p>- Estuche de Cart&oacute;n Reciclado.</p>', NULL, 1, 20, 9900.00, '', 0, NULL, NULL, NULL, NULL),
(745, 'Cristal Decorativo Slipknot', 'SLIPKNOTK9', NULL, 8500.00, 1, '2024-05-08 17:39:05', '2024-05-08 17:39:16', 116, 4999, '<p>🔥 &iexcl;Prep&aacute;rate para sumergirte en el oscuro y en&eacute;rgico mundo de Slipknot! 🤘 &iquest;Quieres llevar un pedazo de su esencia contigo? 🎸 &iexcl;Te mostramos c&oacute;mo grabamos este alucinante adorno de cristal inspirado en la legendaria banda! 🖤 Desde el dise&ntilde;o hasta el proceso de grabado, &iexcl;te llevamos detr&aacute;s de escena! 💀 Adquiere el tuyo ahora mismo y haz que tu fanatismo por Slipknot brille como nunca antes. 🌟 &iexcl;&Uacute;nete a la revoluci&oacute;n del metal! #Slipknot #Fan&aacute;ticoDelMetal #QDigital 🎶🔥</p>', NULL, 1, 5, 8500.00, '', 0, NULL, NULL, NULL, NULL);
